INSERT INTO `essential` VALUES ('EL000001','Fendrr','NONMMUT131806.1','68790','Foxf1 adjacent non-coding developmental regulatory RNA;LL66; linc-F; lincFoxf1; linc-Foxf1a; 1110050K14Rik','mouse','REID0001','This gene encodes a spliced long non-coding RNA transcribed from a bidirectional promoter shared with Foxf1 on the opposite strand. The encoded transcript is essential for normal development of the heart and body wall. It is thought to act by binding to polycomb repressive complex 2 (PRC2) and/or TrxG/MLL complexes to promote the methylation of the promoters of target genes, thus reducing their expression. It plays a role in cell fate determination in tissues derived from the lateral plate mesoderm. Knockout models reveal loss of this gene is lethal in mice. Alternatively spliced transcript variants have been identified. ','>NC_000074.7:c121809849-121781621 Fendrr [organism=Mus musculus] [GeneID=68790] [chromosome=8]','knockdown of fendrr is perinatal lethal due to defects in multiple organs.',1),('EL000002','Gm38509 ','NONMMUT042552.2','102638436','predicted gene, 38509;Peril','mouse','REID0002','Not Found.','>NC_000069.7:34826224-34836495 Gm38509 [organism=Mus musculus] [GeneID=102638436] [chromosome=3]','peril knockout mice  have reduced viability and die shortly after birth.',2),('EL000003','Haglr','NONMMUT037990.2','102634678','Hoxd antisense growth associated long non-coding RNA;Mdgt; Hoxd-as1; 6720416L17Rik','mouse','REID0003','Not Found.','>NC_000068.8:c74593240-74578766 Haglr [organism=Mus musculus] [GeneID=102634678] [chromosome=2]','Deletion of Mdgt results in viability defects.',3),('EL000004','Pantr2','NONMMUT000753.2','66620','POU domain, class 3, transcription factor 3 adjacent noncoding transcript 2;Pou3f; linc-; Pou3f3os2; linc-Brn1b; 2610207O16Rik','mouse','REID0004','Not Found.','>NC_000067.7:c42752614-42746221 Pantr2 [organism=Mus musculus] [GeneID=66620] [chromosome=1]',' lincBrn1b knockout mice exhibit a decrease in proliferation of cortical progenitors in vivo, and that this defect is restricted to a specific subpopulation of progenitors in the SVZ of the developing cortex.',4),('EL000005','Lncpint ','NONMMUT056160.2','232685','long non-protein coding RNA, Trp53 induced transcript;P; Li; Lin; Pint; AB04180; Lincpint; MNCb-176; MNCb-1768; linc-Pint','mouse','REID0005','Involved in several processes, including adipose tissue development; adult somatic muscle development; and hair follicle development. Orthologous to human LINC-PINT (long intergenic non-protein coding RNA, p53 induced transcript).','>NC_000072.7:c31195409-31070498 Lncpint [organism=Mus musculus] [GeneID=232685] [chromosome=6]','In mouse cells, Pint promotes cell proliferation and survival by regulating the expression of genes of the TGF-b, MAPK and p53 pathways. ',5),('EL000006','LINC-PINT',' NONHSAT123383.2','378805','long intergenic non-protein coding RNA, p53 induced transcript;PINT; MKLN1-AS1; LincRNA-Pint','human','REID0006','Not Found.','>NC_000007.14:c131109925-130877562 LINC-PINT [organism=Homo sapiens] [GeneID=378805] [chromosome=7]','LINC-PINT suppresses tumour cell proliferation, migration and invasion through targeting miR-374a-5p in ovarian cancer.',6),('EL000007','Tsix','NONMMUT073453.2','22097','X (inactive)-specific transcript, opposite strand','mouse','REID0007','Not Found.','>NC_000086.8:102475123-102528563 Tsix [organism=Mus musculus] [GeneID=22097] [chromosome=X]','Tsix plays a crucial role in maintaining Xist silencing in cis and in regulation of imprinted X-inactivation in the extra-embryonic tissues.',7),('EL000008','Dnm3os ','NONMMUT076672.1','474332','dynamin 3, opposite strand','mouse','REID0008','Not Found.','>NC_000067.7:162045192-162053119 Dnm3os [organism=Mus musculus] [GeneID=474332] [chromosome=1]','Dnm3os,is Required for Normal Growth and Skeletal Development in Mice.',8),('EL000009','EPB41L4A-DT','Not Found.','54508','EPB41L4A divergent transcript ;EPB41L4A-AS2','human','REID0009','Not Found.','>NC_000005.10:112419583-112420978 EPB41L4A-DT [organism=Homo sapiens] [GeneID=54508] [chromosome=5]','The long non-coding RNA EPB41L4A-AS2 inhibits tumor proliferation and is associated with favorable prognoses in breast cancer and other solid tumors.',9),('EL000010','Mir124a-1hg','NONMMUT021287.2','268755','Mir124-1 host gene (non-protein coding);Rn; Rncr3; mir-3078; mir-124-1; A930011O12Rik','mouse','REID0010','Involved in several processes, including gene silencing by miRNA; long-term synaptic potentiation; and sensory perception of sound.','>NC_000080.7:64825564-64831410 Mir124a-1hg [organism=Mus musculus] [GeneID=268755] [chromosome=14]','the miR-124 promoted the differentiation of neuronal cells from BMMSCs, and this mechanism was miR-124 reduced the expression of PTBP1, increased the expression of PTBP2.',10),('EL000011','Meg3','NONMMUT015695.2','17263','maternally expressed 3;Gtl; Gtl2; R74756; R75394; AI425946; AW108224; D12Bwg1266e; 2900016C05Rik; 3110050O07Rik; 6330408G06Rik','mouse','REID0011','This gene is paternally-imprinted and thus expressed predominantly from the maternal allele. It generates alternatively-spliced long non protein-coding RNAs that overlap with the microRNAs Mir770 and Mir1906-1. Transcripts from this gene function as negative regulators of growth and may be down-regulated in tumor cells. This gene is expressed in a reciprocal pattern from the nearby Dlk1 (delta-like 1 homolog) gene, which is paternally-expressed. Deletion of this locus disrupts imprinting in this genomic region and results in perinatal morbidity.','>NC_000078.7:109506879-109538163 Meg3 [organism=Mus musculus] [GeneID=17263] [chromosome=12]','Maternal deletion of the Meg3 gene in mice results in skeletal muscle defects and perinatal death.',11),('EL000012','MEG3','NONHSAT039746.2','55384','maternally expressed 3;GTL2; FP504; prebp1; PRO0518; PRO2160; LINC00023; NCRNA00023; onco-lncRNA-83','human','REID0012','This gene is a maternally expressed imprinted gene. Multiple alternatively spliced transcript variants have been transcribed from this gene and all of them are long non-coding RNAs (lncRNAs). This gene is expressed in many normal tissues, but its expression is lost in multiple cancer cell lines of various tissue origins. It inhibits tumor cell proliferation in vitro. It also interacts with the tumor suppressor p53, and regulates p53 target gene expression. Its deletion enhances angiogenesis in vivo. Many experimental evidences demonstrate that this gene is a lncRNA tumor suppressor.','>NC_000014.9:100826108-100861026 MEG3 [organism=Homo sapiens] [GeneID=55384] [chromosome=14]','MEG3 induces accumulation of p53 (TP53) protein, stimulates transcription from a p53-dependent promoter, and selectively regulates p53 target gene expression.MEG3 is a lncRNA tumor suppressor.Loss of MEG3 expression in various human tumors has been well documented. Re-expression of MEG3 inhibits proliferation, induces apoptosis, and inhibits anchorage-independent growth of human tumor cells.',12),('EL000013','LINC00261','NONHSAT078992.2','140828',' long intergenic non-protein coding RNA 261;ALIEN; DEANR1; FALCOR; HCCDR1; C20orf56; NCRNA00261; TCONS_00027846; onco-lncRNA-17','human','REID0013','This gene produces a long non-coding RNA that acts as a negative regulator of cell growth. This transcript may promote differentiation and apoptosis.','>NC_000020.11:c22578642-22560553 LINC00261 [organism=Homo sapiens] [GeneID=140828] [chromosome=20]','LINC00261 as a tumor suppressor that blocks cellular proliferation by activating the DNA damage response and suggest that epigenetic therapy to inhibit DNA methylation may enhance treatment of LUAD.',13),('EL000014','CCAT2','NONHSAT216396.1','101805488','colon cancer associated transcript 2;NCCP1; LINC00873','human','REID0014','This gene produces a long non-coding RNA that is upregulated in colon cancer and other cancers. This transcript promotes cell proliferation and suppresses apoptosis. It negatively regulates the biogenesis of microRNA 145.','>NC_000008.11:127400399-127402150 CCAT2 [organism=Homo sapiens] [GeneID=101805488] [chromosome=8]','Knockdown of long non?coding RNA CCAT2 suppresses the progression of thyroid cancer by inhibiting the Wnt/?catenin pathway.',14),('EL000015','Chaserr','NONMMUT062154.2','69170','CHD2 adjacent suppressive regulatory RNA ;linc2025; 1810026B05Rik','mouse','REID0015','Not Found.','>NC_000073.7:c73208143-73189546 Chaserr [organism=Mus musculus] [GeneID=69170] [chromosome=7]','Loss of Chaserr in mice leads to early postnatal lethality in homozygous mice, and severe growth retardation in heterozygotes.Regulation of CHD2 expression by the Chaserr long noncoding RNA gene is essential for viability.',15),('EL000016','LIVAR ','Not Found.','102724895',' liver cell viability associated lncRNA;lnc18q22.2','human','REID0016','Not Found.','>NC_000018.10:c70338180-70335508 LIVAR [organism=Homo sapiens] [GeneID=102724895] [chromosome=18]','knockdown of lnc18q22.1 resulted phenotypes ranging from reduced cell growth to lethality. ',16),('EL000017','Xist','NONMMUT073456.2','213742','X-inactive specific transcript;AI314753; A430022B11','mouse','REID0017','X inactivation is an early developmental process in mammalian females that transcriptionally silences one of the pair of X chromosomes, thus providing dosage equivalence between males and females. The process is regulated by several factors, including a region of chromosome X called the X inactivation center (XIC). The XIC comprises several non-coding and protein-coding genes, and this gene was the first non-coding gene identified within the XIC. This gene is expressed exclusively from the XIC of the inactive X chromosome. It is essential for the initiation and spread of X-inactivation. It silences hundreds of genes by recruiting and tethering repressive chromatin-modifying complexes to the inactive X chromosome. Alternatively spliced transcript variants have been identified.','>NC_000086.8:c102526839-102503979 Xist [organism=Mus musculus] [GeneID=213742] [chromosome=X]','Xist suppresses hematologic cancer.Deleting Xist is sufficient to induce an aggressive and lethal blood cancer.upregulation of X-linked genes after deleting Xist leads to genome-wide changes in key developmental and homeostatic pathways, which in turn drive progression toward cancer.',17),('EL000018','XIST','NONHSAT137541.2','7503','X inactive specific transcript;SXI1; swd66; DXS1089; DXS399E; LINC00001;NCRNA00001','human','REID0018','X inactivation is an early developmental process in mammalian females that transcriptionally silences one of the pair of X chromosomes, thus providing dosage equivalence between males and females. The process is regulated by several factors, including a region of chromosome X called the X inactivation center (XIC). The XIC comprises several non-coding and protein-coding genes, and this gene was the first non-coding gene identified within the XIC. This gene is expressed exclusively from the XIC of the inactive X chromosome, and is essential for the initiation and spread of X-inactivation. The transcript is a spliced RNA. Alternatively spliced transcript variants have been identified, but their full length sequences have not been determined. Mutations in the XIST promoter cause familial skewed X inactivation.','>NC_000023.11:c73852753-73820651 XIST [organism=Homo sapiens] [GeneID=7503] [chromosome=X]','Upregulation of long noncoding RNA XIST has anticancer effects on ovarian cancer through sponging miR-106a.',18),('EL000019','Gm12610','NONMMUT148099.1','102633081','predicted gene 12610;ANRIL; Gm12609','mouse','REID0019','Not Found.','>NC_000070.7:89213417-89406858 Gm12610 [organism=Mus musculus] [GeneID=102633081] [chromosome=4]','Overexpression of long non-coding RNA ANRIL promotes post-ischaemic angiogenesis and improves cardiac functions by targeting Akt.',19),('EL000020','TUG1',' NONHSAT084833.2','55000','taurine upregulated gene 1;TI-227H; LINC00080; NCRNA00080','human','REID0020','Involved in photoreceptor cell development and regulation of gene expression. Localizes to nucleus. Is expressed in several structures, including central nervous system; heart; olfactory epithelium; retina; and spleen. Orthologous to human TUG1 (taurine up-regulated 1).','>NC_000022.11:30969211-30979395 TUG1 [organism=Homo sapiens] [GeneID=55000] [chromosome=22]',' knockdown of TUG1 could impair HCC cells proliferation, invasion and induce cell apoptosis both in vitro and vivo. ',20),('EL000021','GAS5','NONHSAT227355.1','60674','growth arrest specific 5 ;SNHG2; NCRNA00030','human','REID0021','This gene produces a spliced long non-coding RNA and is a member of the 5\' terminal oligo-pyrimidine class of genes. It is a small nucleolar RNA host gene, containing multiple C/D box snoRNA genes in its introns. Part of the secondary RNA structure of the encoded transcript mimics glucocorticoid response element (GRE) which means it can bind to the DNA binding domain of the glucocorticoid receptor (nuclear receptor subfamily 3, group C, member 1). This action blocks the glucocorticoid receptor from being activated and thereby stops it from regulating the transcription of its target genes. This transcript is also thought to regulate the transcriptional activity of other receptors, such as androgen, progesterone and mineralocorticoid receptors, that can bind to its GRE mimic region. Multiple functions have been associated with this transcript, including cellular growth arrest and apoptosis. It has also been identified as a potential tumor suppressor, with its down-regulation associated with cancer in multiple different tissues.','>NC_000001.11:c173868882-173863899 GAS5 [organism=Homo sapiens] [GeneID=60674] [chromosome=1]','growth arrest-specific transcript 5 (GAS5) that induces apoptosis in breast and prostate cancers by inhibiting several responsive genes leading to altering various cellular processes.',21),('EL000022','LncRNA-AF113014','Not Found.','Not Found.','Not Found.','human','REID0022','Not Found.','Not Found.','AF113014 acts as a tumor suppressor by regulating the expression of the tumor suppressor gene,Egr2 through interaction with miR-20a causing a decrease in cellular proliferation',22),('EL000023','UC.134','Not Found.','110599565','long non-coding RNA uc.134','human','REID0023','Not Found.','>NC_000003.12:158526708-158528574 UC.134 [organism=Homo sapiens] [GeneID=110599565] [chromosome=3]','Uc.134 is reported to be significantly downregulated in HCC cells; its overexpression suppresses HCC  by inhibiting cellular invasion and proliferation via repression of CUL4-mediated ubiquitination of LATS1 and activation of YAPS127 phosphorylation.',23),('EL000024','SRA1','NONHSAT250486.1','10011',' steroid receptor RNA activator 1;SRA; SRAP; STRAA1; pp7684','human','REID0024','Both long non-coding and protein-coding RNAs are transcribed from this gene, and they represent alternatively spliced transcript variants. This gene was initially defined as a non-coding RNA, which is a coactivator for several nuclear receptors (NRs) and is associated with breast cancer. It has now been found that this gene is involved in the regulation of many NR and non-NR activities, including metabolism, adipogenesis and chromatin organization. The long non-coding RNA transcripts interact with a variety of proteins, including the protein encoded by this gene. The encoded protein acts as a transcriptional repressor by binding to the non-coding RNA.','>NC_000005.10:c140558093-140550067 SRA1 [organism=Homo sapiens] [GeneID=10011] [chromosome=5]','SRA1 is one of the downregulated RNAs in HCC cells that serves as a tumor suppressive through  its regulation of tumor size and serum glucose levels.',24),('EL000025','DGCR5','NONHSAT083310.2','26220','DiGeorge syndrome critical region gene 5 ;DGCR10, DGCR9, DGS-A, DGS-B, LINC00037, NCRNA00037, POM121L5P','human','REID0025','Not Found.','>NC_000022.11:18970498-19031242 DGCR5 [organism=Homo sapiens] [GeneID=26220] [chromosome=22]','LncRNA DGCR5 plays a tumor-suppressive role in glioma via the miR-21/Smad7 and miR-23a/PTEN axes.',25),('EL000026','ZNF674-AS1','NONHSAT136839.2','401588','ZNF674 antisense RNA 1 (head to head)','human','REID0026','Not Found.','>NC_000023.11:46545490-46548475 ZNF674-AS1 [organism=Homo sapiens] [GeneID=401588] [chromosome=X]','lncRNA ZNF674-AS1 is found to be downregulated in HCC patients with significant relation to poor  prognosis in patients;low ZNF674-AS1 expression was significantly associated with clinical stage, histopathologic grading, and cancer distal metastasis. The KaplanMeier analysis showed that patients with low levels of ZNF674-AS1 expression tended to live a shorter life than those with high levels.ZNF674-AS1 may be a tumor suppressor gene.',26),('EL000027','STARD13','NONHSAT033146.2','90627','StAR related lipid transfer domain containing 13;DLC2; GT650; ARHGAP37; LINC00464','human','REID0027','This gene encodes a protein which contains an N-terminal sterile alpha motif (SAM) for protein-protein interactions, followed by an ATP/GTP-binding motif, a GTPase-activating protein (GAP) domain, and a C-terminal STAR-related lipid transfer (START) domain. It may be involved in regulation of cytoskeletal reorganization, cell proliferation, and cell motility, and acts as a tumor suppressor in hepatoma cells. The gene is located in a region of chromosome 13 that is associated with loss of heterozygosity in hepatocellular carcinomas. Alternatively spliced transcript variants encoding different isoforms have been described for this gene.','>NC_000013.11:c33676829-33103137 STARD13 [organism=Homo sapiens] [GeneID=90627] [chromosome=13]',' STARD13 is a tumor suppressor as its expression levels in HCC is low and  its upregulation enhances cellular apoptosis by acting as a ceRNA for Fas and increases tumor sensitivity to chemotherapy.',27),('EL000028','ZFAS1 ',' NONHSAT080209.2','441951','ZNFX1 antisense RNA 1;HSUP1; HSUP2; C20orf199; ZNFX1-AS1; NCRNA00275','human','REID0028','This gene represents a snoRNA host gene that produces a non-coding RNA. Increased expression or amplification of this locus is associated with cancer progression and metastasis. This transcript regulates expression of genes involved in differentiation. It may act a molecular sponge for microRNAs. Alternatively spliced transcript variants have been observed.','>NC_000020.11:49278178-49289260 ZFAS1 [organism=Homo sapiens] [GeneID=441951] [chromosome=20]','ZNFX1-AS1 is significantly downregulated in HCC  and its overexpression suppressed cell proliferation,  colony formation and promoted cell apoptosis',28),('EL000029','LINC00052','NONHSAT048149.2','145978','long intergenic non-protein coding RNA 52 ;TMEM83; NCRNA00052','human','REID0029','Not Found.','>NC_000015.10:87576929-87579686 LINC00052 [organism=Homo sapiens] [GeneID=145978] [chromosome=15]','LINC00052 is one of the tumor  suppressor lncRNAs as its upregulation inhibit cell invasion and proliferation abilities of HCC cells which is achieved through regulating NTRK3 expression by establishing complementary base pairing with miR-128 and miR-485-3p.',29),('EL000030','NTRK3','NONHSAT048142.2','4916','neurotrophic receptor tyrosine kinase 3 ;TRKC; GP145-TrkC; gp145(trkC)','human','REID0030','This gene encodes a member of the neurotrophic tyrosine receptor kinase (NTRK) family. This kinase is a membrane-bound receptor that, upon neurotrophin binding, phosphorylates itself and members of the MAPK pathway. Signalling through this kinase leads to cell differentiation and may play a role in the development of proprioceptive neurons that sense body position. Mutations in this gene have been associated with medulloblastomas, secretory breast carcinomas and other cancers. Several transcript variants encoding different isoforms have been found for this gene.','>NC_000015.10:c88256796-87859749 NTRK3 [organism=Homo sapiens] [GeneID=4916] [chromosome=15]','Downregulation of NTRK3 promotes cellular invasion and proliferation abilities just like the low levels of LINC00052.',30),('EL000031','PRAL','Not Found.','109245082','p53 regulation associated lncRNA;lncRNA-PRAL','human','REID0031','Not Found.','Not Found.',' PRAL is a tumor suppressor lncRNA present on chromosome 17p13.1 usually in low levels in HCC patients and its overexpression inhibits tumor growth. This occurs due to the binding of PRAL to HSP90 which enhances its binding to p53,opposes MDM2 induced p53 degradation hence promoting HCC cell apoptosis.',31),('EL000032','CPS1-IT1 ','NONHSAT076682.2','29034','CPS1 intronic transcript 1;CPS1IT; CPS1-IT; CPS1IT1; PRO0132','human','REID0032','This gene does not encode a protein, and it is located within an intron of the gene encoding carbamoyl-phosphate synthetase 1. ','>NC_000002.12:210617571-210619876 CPS1-IT1 [organism=Homo sapiens] [GeneID=29034] [chromosome=2]','Long noncoding RNA CPS1-IT1 suppresses the metastasis of hepatocellular carcinoma by regulating HIF-1 activity and inhibiting epithelial-mesenchymal transition.',32),('EL000033','TUSC7',' NONHSAT091315.2','285194',' tumor suppressor candidate 7;LSAMPAS3; LINC00902; LSAMP-AS1; LSAMP-AS3; NCRNA00295','human','REID0033','Not Found.','>NC_000003.12:116709788-116717040 TUSC7 [organism=Homo sapiens] [GeneID=285194] [chromosome=3]','TUSC7 acts as tumor suppressor through the TUSC7-miR-10a-EphA4 axis leading to EMT suppression.',33),('EL000034','WT1-AS','NONHSAT018660.2','51352',' WT1 antisense RNA ;WIT1; WIT-1; WT1AS; WT1-AS1','human','REID0034','This gene is located upstream of the Wilms tumor 1 (WT1) gene; these two genes are bi-directionally transcribed from the same promoter region. This gene is imprinted in kidney, with preferential expression from the paternal allele. Imprinting defects at chromosome 11p13 may contribute to tumorigenesis. ','>NC_000011.10:32435518-32458769 WT1-AS [organism=Homo sapiens] [GeneID=51352] [chromosome=11]',' WT1-AS may function as a tumor suppressor in HCC by reversing the oncogenic effects of WT1. WT1-AS downregulates WT1 expression in HCC tumors and promotes apoptosis by binding to the promoter region of WT1.',34),('EL000035','LINC01018 ','NONHSAT100200.2','255167','long intergenic non-protein coding RNA 1018 ;SRHC','human','REID0035','Not Found.','>NC_000005.10:6582136-6588500 LINC01018 [organism=Homo sapiens] [GeneID=255167] [chromosome=5]','SRHC is noncoding tumor suppressor that can inhibit HCC cell proliferation and promote its differentiation.',35),('EL000036','CASC2','NONHSAT016552.2','255082','cancer susceptibility 2;C10orf5','human','REID0036','Not Found.','>NC_000010.11:118046821-118210153 CASC2 [organism=Homo sapiens] [GeneID=255082] [chromosome=10]','CASC2 inhibits cell proliferation, migration and invasion and promotes apoptosis by inactivation of the MAPK pathway this indicates that CASC2 may act as a tumour suppressor in HCC.',36),('EL000037','TRERNA1 ','NONHSAT080252.2','100887755','translation regulatory long non-coding RNA 1;treRNA; LINC00651','human','REID0037','Not Found.','>NC_000020.11:c50041629-50040707 TRERNA1 [organism=Homo sapiens] [GeneID=100887755] [chromosome=20]',' Suppression of treRNA by miR-190a significantly inhibited migration of HCC cells. This lead to reduced expression of Vimentin and SNAI1 (mesenchymal markers), as well as induced expression of E-cadherin and Claudin-1 (epithelial markers).',37),('EL000038','lncKdm2b ','Not Found.','Not Found.','Not Found.','mouse','REID0038','Not Found.','Not Found.','LncKdm2b deficiency in the hematopoietic system led to reductions in the number and effector functions of ILC3s. LncKdm2b expression sustained the maintenance of ILC3s by promoting their proliferation through activation of the transcription  factor Zfp292. Mechanistically, lncKdm2b recruited the chromatin organizer Satb1 and the nuclear remodeling factor (NURF) complex onto the Zfp292 promoter to initiate its transcription.LncKdm2b deficiency abrogates blastocyst development at embryonic day 3 (E3.0), leading to early embryonic lethality.',38),('EL000039','Bvht ','Not Found.','545261','braveheart long non-coding RNA;Gm20748; Braveheart',' mouse','REID0039','This gene encodes a spliced long non-coding RNA that may play a critical role in cardiovascular lineage commitment. During cardiomyocyte differentiation this transcript interacts with SUZ12, a component of polycomb repressive complex 2 (PRC2) which is known to mediate epigenetic gene silencing. It has been suggested that this transcript functions by activating a network of genes that control cardiovascular cell fate. ','>NC_000084.7:61772724-61780556 Bvht [organism=Mus musculus] [GeneID=545261] [chromosome=18]','Bvht is necessary for activation of a core cardiovascular gene network and functions upstream of mesoderm posterior 1(MesP1), a master regulator of a common multipotent cardiovascular progenitor. Bvht interacts with SUZ12, a component of polycombrepressive complex 2 (PRC2), during cardiomyocyte differentiation, suggesting that Bvht mediates epigenetic regulation of cardiac commitment. together,Bvht plays a role in maintaining cardiac fate in neonatal cardiomyocytes. ',39),('EL000040','HOTTIP','NONHSAT211845.1','100316868','HOXA distal transcript antisense RNA;HOXA-AS6; HOXA13-AS1; NCRNA00213','human','REID0040','This gene produces a long RNA in antisense to the HOXA gene cluster. This transcript may regulate expression of HOXA genes in cis. This gene is upregulated in tumors and is implicated in the promotion of cell proliferation.','>NC_000007.14:27200421-27207259 HOTTIP [organism=Homo sapiens] [GeneID=100316868] [chromosome=7]','LncRNA HOTTIP promotes the proliferation and invasion of ovarian cancer cells by activating the MEK/ERK pathway.',40),('EL000041','NPTN-IT1',' NONHSAT047148.2','101241892','NPTN intronic transcript 1;lncRNA-LET','human','REID0041','Not Found.','>NC_000015.10:c73569543-73566938 NPTN-IT1 [organism=Homo sapiens] [GeneID=101241892] [chromosome=15]','LncRNA-LET inhibits cell viability, migration and EMT while induces apoptosis by up-regulation of TIMP2 in human granulosa-like tumor cell line KGN.',41),('EL000042','Paupar','NONMMUT038963.2','103164605','Pax6 upstream antisense RNA','mouse','REID0042','Exhibits chromatin binding activity. Involved in gene expression; neural precursor cell proliferation; and neurogenesis. Localizes to cytoplasm and nucleoplasm. Orthologous to human PAUPAR (PAX6 upstream antisense RNA).','>NC_000068.8:c105491688-105488207 Paupar [organism=Mus musculus] [GeneID=103164605] [chromosome=2]','The Long Noncoding RNA Paupar Modulates PAX6 Regulatory Activities to Promote Alpha Cell Development and Function.',42),('EL000043','HULC','NONHSAT107640.2','728655','hepatocellular carcinoma up-regulated long non-coding RNA;HCCAT1, LINC00078, NCRNA00078','human','REID0043','This gene produces a long RNA that was discovered as upregulated in hepatocellular carcinoma and is associated with cancer progression. Expression of this transcript is regulated by microRNAs and at the transcriptional level by Sp1 family factors. The transcript may regulate gene expression by functioning as a competing RNA for microRNAs. ','>NC_000006.12:8652209-8653846 HULC [organism=Homo sapiens] [GeneID=728655] [chromosome=6]','Long non-coding RNA HULC interacts with miR-613 to regulate colon cancer growth and metastasis through targeting RTKN.',43),('EL000044','CYTOR ','NONHSAT240813.1','112597','cytoskeleton regulator RNA;C2orf59; LINC00152; NCRNA00152','human','REID0044','This gene produces a long non-coding RNA that is overexpressed in cancer cells and promotes cell proliferation and epithelial-mesenchymal transition. This RNA may bind enhancer of zeste homolog 2 and participate in the transcriptional silencing of tumor suppressor genes. It may act as a sponge for microRNAs. Alternatively spliced variants have been observed.','>NC_000002.12:87455427-87521518 CYTOR [organism=Homo sapiens] [GeneID=112597] [chromosome=2]','Long Intergenic Noncoding RNA 00152 Promotes Glioma Cell Proliferation and Invasion by Interacting with MiR-16.',44),('EL000045','LNCRNA-ATB','NONHSAT168138.1','114004396','long noncoding RNA activated by TGF-beta','human','REID0045','Not Found.','>NC_000014.9:19126530-19128974 LNCRNA-ATB [organism=Homo sapiens] [GeneID=114004396] [chromosome=14]','lncRNA-ATB enhanced the expression of ZEB1 and ZEB2 by competitive binding to the miR-200 family and hence,induced EMT and invasion. Furthermore, lncRNA-ATB stimulated organ colonization of disseminated tumor cells by binding IL-11 mRNA, autocrine induction of IL-11, and triggering STAT3 signalling. Generally, lncRNAATB promotes the invasion-metastases cascade.',45),('EL000046','JPX','NONHSAT258235.1','554203','JPX transcript, XIST activator;DCBALD06, ENOX, LINC00183, NCRNA00183','human','REID0046','JPX is a nonprotein-coding RNA transcribed from a gene within the X-inactivation center (XIC; MIM 314670) that appears to participate in X chromosome inactivation','>NC_000023.11:73944324-74070384 JPX [organism=Homo sapiens] [GeneID=554203] [chromosome=X]','Long noncoding RNA-JPX predicts the poor prognosis of ovarian cancer patients and promotes tumor cell proliferation, invasion and migration by the PI3K/Akt/mTOR signaling pathway.',46),('EL000047','AIRN','NONHSAT115887.2','100271873','antisense of IGF2R non-protein coding RNA;AIR;IGF2RAS; IGF2R-AS; IGF2R-AS1; NCRNA00088','human','REID0047','Both spliced and un-spliced long non-coding RNAs are transcribed from this gene. This gene overlaps on the opposite strand the second intron of the insulin-like growth factor 2 receptor gene; a CpG island associated with the second intron denotes an active promoter that drives the expression of this gene. The related mouse gene is responsible for silencing the insulin-like growth factor 2 receptor gene and flanking genes in the imprinted gene cluster of mice. This gene may be expressed in Wilms tumors.','>NC_000006.12:c160007664-160003291 AIRN [organism=Homo sapiens] [GeneID=100271873] [chromosome=6]','Silencing of Airn via siRNAs augmented cell death, vulnerability to cellular stress, and reduced cell migration. ',47),('EL000048','KCNQ1OT1','NONHSAT017523.2','10984','KCNQ1 opposite strand/antisense transcript 1;KCNQ1-AS2, KCNQ10T1, Kncq1, KvDMR1, KvLQT1-AS, LIT1, NCRNA00012','human','REID0048','Human chromosomal region 11p15.5 contains two clusters of epigenetically-regulated genes that are expressed from only one chromosome in a parent-of-origin manner. Each cluster, or imprinted domain, is regulated by a functionally independent imprinting control region (ICR). The human CDKN1C/KCNQ1OT1 domain is regulated by an ICR located in an intron of KCNQ1, and contains at least eight genes that are expressed exclusively or preferentially from the maternally-inherited allele. The DNA of the ICR is specifically methylated on the maternally-inherited chromosome, and unmethylated on the paternally-inherited chromosome. The ICR contains the promoter of the KCNQ1OT1 gene that is exclusively expressed from the paternal allele. The KCNQ1OT1 transcript is the antisense to the KCNQ1 gene and is a unspliced long non-coding RNA. It interacts with chromatin and regulates transcription of multiple target genes through epigenetic modifications. The transcript is abnormally expressed from both chromosomes in most patients with Beckwith-Wiedemann syndrome, and the transcript also plays an important role in colorectal carcinogenesis.','>NC_000011.10:c2699998-2608328 KCNQ1OT1 [organism=Homo sapiens] [GeneID=10984] [chromosome=11]','KCNQ1OT1 promotes ovarian cancer progression via modulating MIR-142-5p/CAPN10 axis.',48),('EL000049','Trp53cor1','NONMMUT028986.2','100504267',' tumor protein p53 pathway corepressor 1;linc; Gm16197; linc-p21; lincRNA-p21','mouse','REID0049','Involved in negative regulation of gene expression. Localizes to ribonucleoprotein complex.','>NC_000083.7:c29298100-29276448 Trp53cor1 [organism=Mus musculus] [GeneID=100504267] [chromosome=17]','p53-targeted lincRNA-p21 acts as a tumor suppressor by inhibiting JAK2/STAT3 signaling pathways in head and neck squamous cell carcinoma.',49),('EL000050','MIR31HG',' NONHSAT257352.1','554202','?MIR31 host gene;LncHIFCAR, hsa-lnc-31','human','REID0050','This gene produces a long non-coding RNA that acts as a host gene for miR-31. This transcript may be involved in cellular pluripotency and regulate the differentiation of myoblasts and other tissues. This RNA was found to interact with Polycomb repressive proteins to repression transcription of genes involves in cell senescence.','>NC_000009.12:c21559798-21454268 MIR31HG [organism=Homo sapiens] [GeneID=554202] [chromosome=9]','Long noncoding RNA MIR31HG inhibits hepatocellular carcinoma proliferation and metastasis by sponging microRNA-575 to modulate ST7L expression.',50),('EL000051','FLVCR1-DT',' NONHSAT009410.2','642946','FLVCR1 divergent transcript;LQK1; FLVCR1-AS1; NCRNA00292','human','REID0051','Not Found.','>NC_000001.11:c212858138-212856604 FLVCR1-DT [organism=Homo sapiens] [GeneID=642946] [chromosome=1]','LncRNA FLVCR1-AS1 acts as miR-513c sponge to modulate cancer cell proliferation, migration, and invasion in hepatocellular carcinoma. FLVCR1-AS1 knockdown  remarkably inhibited HCC cell proliferation, migration, and invasion in vitro and in vivo while induced cell apoptosis.In mechanism, FLVCR1-AS1 acted as a microRNA sponge of miR-513c which targeted the mRNA of MET for degradation. By directly sponging miR-513c, FLVCR1-AS1 increased MET expression in HCC and then promoted HCC growth. ',51),('EL000052',' LINC00032','Not Found.','158035','long intergenic non-protein coding RNA 32;C9orf14;NCRNA00032','human','REID0052','Not Found.','>NC_000009.12:c27282793-27245684 LINC00032 [organism=Homo sapiens] [GeneID=158035] [chromosome=9]','An analysis of genome-wide DNA copy number alterations in melanoma tumors revealed the loss of the C9orf14 locus, located proximal to CDKN2A, in approximately one-fourth of tumors. Analysis of gene expression data in cancer cell lines and melanoma tumors suggests a loss of C9orf14 expression in melanoma tumorigenesis. So C9orf14 is a candidate tumor suppressor for nevus development and late stage melanoma at 9p21, a region frequently deleted in different types of human cancers.',52),('EL000053','MIR22HG','NONHSAT144856.2','84981','MIR22 host geneC17orf91','human','REID0053','Not Found.','>NC_000017.11:c1716272-1711504 MIR22HG [organism=Homo sapiens] [GeneID=84981] [chromosome=17]>NT_187611.1:c146300-141532 MIR22HG [organism=Homo sapiens] [GeneID=84981] [chromosome=17]','Long noncoding RNA MIR22HG inhibits cell proliferation and migration in cholangiocarcinoma by negatively regulating the Wnt/catenin signaling pathway.',53),('EL000054','DLX6-AS1','NONHSAT122125.2','285987','DLX6 antisense RNA 1;Evf-2; DLX6AS; DLX6-AS; NCRNA00212','human','REID0054','Not Found.','>NC_000007.14:c97014065-96968515 DLX6-AS1 [organism=Homo sapiens] [GeneID=285987] [chromosome=7]','DLX6-AS1 was significantly upregulated in PCa(Prostate cancer) tissues and cells.Knockdown of DLX6-AS1 inhibited PCa progression by suppressing cell proliferation and accelerating cell apoptosis.',54),('EL000055','NORAD','NONHSAT079548.2','647979','non-coding RNA activated by DNA damage;LINC00657','human','REID0055','Not Found.','>NC_000020.11:c36050960-36045618 NORAD [organism=Homo sapiens] [GeneID=647979] [chromosome=20]','LncRNA NORAD promotes proliferation, migration and angiogenesis of hepatocellular carcinoma cells through targeting miR-211-5p/FOXD1/VEGF-A axis.',55),('EL000056','LNCTAM34A ','Not Found.','102724571','long non coding transcriptional activator of miR34a;GUARDIN; LINC01759','human','REID0056','Not Found.','>NC_000001.11:9182204-9192086 LNCTAM34A [organism=Homo sapiens] [GeneID=102724571] [chromosome=1]','GUARDIN is a p53-responsive long non-coding RNA that is essential for genomic stability.the p53-responsive lncRNA GUARDIN is important for maintaining genomic integrity under steady-state conditions and after exposure to exogenous genotoxic stress.',56),('EL000057','PANDAR ','NONHSAT209051.1','101154753','promoter of CDKN1A antisense DNA damage activated RNA;PANDA','human','REID0057','This gene produces a non-coding RNA that is thought to regulate the response to DNA damage. This gene is induced by tumor protein p53 and interacts with and modulates the activity of a transcription factor that induce pro-apoptotic genes. Deregulation of this gene is associated with cancer progression. ','>NC_000006.12:c36675126-36673621 PANDAR [organism=Homo sapiens] [GeneID=101154753] [chromosome=6]','Inhibition of lncRNA PANDAR reduces cell proliferation, cell invasion and suppresses EMT pathway in breast cancer.',57),('EL000058','BACE1-AS','NONHSAT024403.2','100379571','BACE1 antisense RNA;BACE1-AS1, BACE1AS, NCRNA00177','human','REID0058','This gene encodes an unspliced long non-coding RNA transcribed from the opposite strand to BACE1. The encoded transcript is thought to form an RNA duplex with BACE1 mRNA thereby regulating its expression and is also thought to promote post-transcriptional feed-forward regulation of BACE1. This may lead to increased levels of beta amyloid and increased senile plaque deposition, and therefore may play a role in the pathophysiology of Alzheimer\'s disease.','>NC_000011.10:117291346-117292170 BACE1-AS [organism=Homo sapiens] [GeneID=100379571] [chromosome=11]','The BACE1-antisense transcript (BACE1-AS) regulates BACE1 mRNA and subsequently BACE1 protein expression in vitro and in vivo.  this conserved noncoding antisense transcript for -secretase-1 (BACE1) is a crucial enzyme in Alzheimers disease pathophysiology.',58),('EL000059','ATXN8OS','NONHSAT034251.2','6315','ATXN8 opposite strand lncRNA;SCA8; KLHL1AS; NCRNA00003','human','REID0059','This gene is an antisense transcript to the KLHL1 gene (homolog to the Drosophila KELCH gene); it does not itself appear to be protein coding. A TAC/TGC trinucleotide repeat expansion that is incorporated into this gene transcript, but not the KLHL1 transcript, causes spinocerebellar ataxia type 8. Presumably the expansion interferes with normal antisense function of this transcript.','>NC_000013.11:70107213-70139753 ATXN8OS [organism=Homo sapiens] [GeneID=6315] [chromosome=13]','Knockdown of ATXN8OS inhibited proliferation, viability and invasion in the human MCF7 and MDA?MB?231 BC cell lines. ',59),('EL000060','UCA1','NONHSAT061515.2','652995','urothelial cancer associated 1,CUDR, LINC00178, NCRNA00178, UCAT1, onco-lncRNA-36','human','REID0060','This gene produces a long non-coding RNA that was found to be upregulated in bladder cancer and plays a regulatory role in cell proliferation. This transcript regulates several genes, including CREB (cAMP responsive element binding protein). Expression of this transcript is regulated by CCAAT/enhancer-binding protein-alpha.','>NC_000019.10:15828947-15836321 UCA1 [organism=Homo sapiens] [GeneID=652995] [chromosome=19]','The lncRNA UCA1 promotes proliferation,migration, immune escape and inhibits apoptosis in gastric cancer by sponging anti-tumor miRNAs.',60),('EL000061','RMRP','NONHSAT130962.2','6023','RNA component of mitochondrial RNA processing endoribonuclease ;CHH, NME1, RMRPR, RRP2','human','REID0061','This gene encodes the RNA component of mitochondrial RNA processing endoribonuclease, which cleaves mitochondrial RNA at a priming site of mitochondrial DNA replication. This RNA also interacts with the telomerase reverse transcriptase catalytic subunit to form a distinct ribonucleoprotein complex that has RNA-dependent RNA polymerase activity and produces double-stranded RNAs that can be processed into small interfering RNA. Mutations in this gene are associated with cartilage-hair hypoplasia.','>NC_000009.12:c35658018-35657751 RMRP [organism=Homo sapiens] [GeneID=6023] [chromosome=9]GGTTCGTGCTGAAGGCCTGTATCCTAGGCTACACACTGAGGACTCTGTTCCTCCCCTTTCCGCCTAGGGGAAAGTCCCCGGACCTCGGGCAGAGAGTGCCACGTGCATACGCACGTAGACATTCCCCGCTTCCCACTCCAAAGTCCGCCAAGAAGCGTATCCCGCTGAGCGGCGTGGCGCGGGGGCGTCATCCGTCAGCTCCCTCTAGTTACGCAGGCAGTGCGTGTCCGCGCACCAACCACACGGGGCTCATTCTCAGCGCGGCTGT','RMRP was the first non-coding nuclear RNA gene implicated in a disease. Its mutations cause cartilage-hair hypoplasia (CHH), an autosomal recessive skeletal dysplasia with growth failure, immunodeficiency, and a high risk for malignancies.?',61),('EL000062','RMST ','NONHSAT030091.2','196475','rhabdomyosarcoma 2 associated transcript;NCRMS; LINC00054; NCRNA00054','human','REID0062','This gene produces a long non-coding RNA that functions in neurogenesis by aiding in the association of Sox2 transcription factor to its target promoters.','>NC_000012.12:97462776-97565015 RMST [organism=Homo sapiens] [GeneID=196475] [chromosome=12]','RMST played a role of tumor suppressor in TNBC through inhibiting cell proliferation, invasion and migration, enhancing cell apoptosis, and regulating cell cycle.',62),('EL000063','SNHG14','Not Found.','104472715','small nucleolar RNA host gene 14;115HG; LNCAT; UBE3A-AS; UBE3AATS; UBE3A-AS1; UBE3A-ATS; NCRNA00214; U-UBE3A-ATS; IC-SNURF-SNRPN','human','REID0063','This gene is located within the Prader-Willi critical region and produces a long, spliced paternally-imprinted RNA that initiates within a common upstream promoter region shared by the SNRPN (small nuclear ribonucleoprotein polypeptide N) and SNURF genes. This transcript serves as a host RNA for the small nucleolar RNA, C/D box 115 and 116 clusters. This RNA extends in antisense into the region of the ubiquitin protein ligase E3A gene (UBE3A), and is thought to regulate imprinted expression of UBE3A in the brain. This transcript undergoes extensive alternative splicing, and may initiate and terminate at multiple locations within this genomic region. The full-length structure of all splice forms is not determined.','>NC_000015.10:24823608-25419462 SNHG14 [organism=Homo sapiens] [GeneID=104472715] [chromosome=15]','Overexpression of SNHG14 inhibited cell growth, induced cell apoptosis, suppressed migration and invasion by inhibiting epithelial-mesenchymal transition process. ',63),('EL000064','HOTAIR',' NONHSAT028509.2','100124700','HOX transcript antisense RNA;HOXAS; HOXC-AS4; HOXC11-AS1; NCRNA00072','human','REID0064','This gene is located within the Homeobox C (HOXC) gene cluster on chromosome 12 and is co-expressed with the HOXC genes. It functions through an RNA product, which binds lysine specific demethylase 1 (LSD1) and Polycomb repressive complex 2 (PRC2), and serves as a scaffold to assemble these regulators at the HOXD gene cluster, thereby promoting epigenetic repression of HOXD. This gene is highly expressed in multiple tumors. Alternatively spliced transcript variants have been identified. ','>NC_000012.12:c53974956-53962308 HOTAIR [organism=Homo sapiens] [GeneID=100124700] [chromosome=12]',' In breast tumors,the expression of HOTAIR is significantly upregulated,HOTAIR overexpression augments cancer invasiveness and metastases and its depletion inhibits cancer invasiveness. siSENSE-mediated knockdown of HOTAIR suppressed the growth of MCF7 and eventually induced apoptotic cell death. HOTAIR is a proto-oncogene and may be misregulated upon exposure to endocrine disrupting chemicals (EDCs) such as BPA and DES and that may contribute toward disease progression including carcinogenesis.',64),('EL000065','PXN-AS1','NONHSAT031119.2','100506649','PXN antisense RNA 1;EyeLinc4','human','REID0065','Not Found.','>NC_000012.12:120201291-120212828 PXN-AS1 [organism=Homo sapiens] [GeneID=100506649] [chromosome=12]','Long non-coding RNA PXN-AS1 suppresses pancreatic cancer progression by acting as a competing endogenous RNA of miR-3064 to upregulate PIP4K2B expression.',65),('EL000066','FOXD3-AS1','NONHSAT003668.2','100996301','FOXD3 antisense RNA 1 ;pasFOXD3','human','REID0066','Not Found.','>NC_000001.11:c63324441-63320884 FOXD3-AS1 [organism=Homo sapiens] [GeneID=100996301] [chromosome=1]','LncRNA FOXD3-AS1 promotes proliferation, invasion and migration of cutaneous malignant melanoma via regulating miR-325/MAP3K2.',66),('EL000067','NPSR1-AS1','NONHSAT120053.2','404744','NPSR1 antisense RNA 1 ;AAA1','human','REID0067','This gene is located within a region that has been associated with asthma susceptibility. The locus is considered non-protein-coding based on lack of protein homology and a lack of experimental support for an encoded protein. Three alternatively spliced transcript variants have been identified for this gene.','>NC_000001.11:c63324441-63320884 FOXD3-AS1 [organism=Homo sapiens] [GeneID=100996301] [chromosome=1]','Hypoxia-inducible long noncoding RNA NPSR1-AS1 promotes the proliferation and glycolysis of hepatocellular carcinoma cells by regulating the MAPK/ERK pathway.',67),('EL000068','HOXA-AS3','NONHSAT119684.2','100133311','HOXA cluster antisense RNA 3;HOXA6as','human','REID0068','Not Found.','>NC_000007.14:27140364-27155928 HOXA-AS3 [organism=Homo sapiens] [GeneID=100133311] [chromosome=7]','LncRNA HOXA-AS3 Sponges miR-29c to Facilitate Cell Proliferation, Metastasis, and EMT Process and Activate the MEK/ERK Signaling Pathway in Hepatocellular Carcinoma.',68),('EL000069','DILA1','Not Found.','Not Found.','Not Found.','human','REID0069','Not Found.','Not Found.','LncRNA DILA1 inhibits Cyclin D1 degradation and contributes to tamoxifen resistance in breast cancer.Knocking down DILA1 decreases Cyclin D1 protein expression, inhibits cancer cell growth and restores tamoxifen sensitivity both in vitro and in vivo.',69),('EL000070','E2F4AS','Not Found.','Not Found.','Not Found.','human','REID0070','Not Found.','Not Found.','The knockdown of E2F4as in ovarian cancer cells led to a decrease in cell proliferation, invasion and migration and an increase in apoptosis.',70),('EL000071','ZEB2-AS1','NONHSAT074777.2','100303491','ZEB2 antisense RNA 1;ZEB2AS; ZEB2-AS; ZEB2NAT','human','REID0071','This gene produces a spliced long non-coding RNA which is a natural antisense transcript corresponding to the 5\' UTR of zinc finger E-box binding homeobox 2 (ZEB2). It is thought that this transcript may be involved in the regulation of ZEB2 expression, and may play a role in the progression of bladder cancer.','>NC_000002.12:144519614-144520899 ZEB2-AS1 [organism=Homo sapiens] [GeneID=100303491] [chromosome=2]','Knockdown of ZEB2-AS1 attenuated the proliferative, migratory and invasive abilities, but induced apoptosis of DLD1 and SW620 cells.',71);
INSERT INTO `essential` VALUES ('EL000072',' IPW','NONHSAT041063.2','3653','imprinted in Prader-Willi syndrome ;NCRNA00002','human','REID0072','This gene is non-protein coding, is expressed exclusively from the paternal allele, and may play a role in the imprinting process. Mutations in this gene are associated with Prader-Willi syndrome.','>NC_000015.10:25116545-25122476 IPW [organism=Homo sapiens] [GeneID=3653] [chromosome=15]',' Lack of expression of IPW may contribute to the PWS phenotype directly.Prader-Willi syndrome (PWS) is a neurobehavioural disorder characterized by neonatal respiratory depression, hypotonia and failure to thrive in infancy, followed by hyperphagia and obesity among other symptoms.',72),('EL000073','EGOT',' NONHSAT087635.2','100126791','eosinophil granule ontogeny transcript;EGO; NCRNA00190','human','REID0073','Not Found.','>NC_000003.12:c4751590-4749192 EGOT [organism=Homo sapiens] [GeneID=100126791] [chromosome=3]','Upregulation of lncRNA EGOT suppressed cell proliferation, migration and invasion, and induced RCC cell apoptosis. ',73),('EL000074','Dreh ','NONMMUT030251.2','101202683','down-regulated in hepatocellular carcinoma;lncRNA-Dreh','mouse','REID0074','Not Found.','>NC_000083.7:65074106-65074926 Dreh [organism=Mus musculus] [GeneID=101202683] [chromosome=17]','lncRNA-Dreh, which can inhibit HCC growth and metastasis in vitro and in vivo, act as a tumor suppressor in the development of hepatitis B virus (HBV)-HCC. LncRNA-Dreh could combine with the intermediate filament protein vimentin and repress its expression, and thus further change the normal cytoskeleton structure to inhibit tumor metastasis.',74),('EL000075','LINC01426 ','NONHSAT081889.2','100506385','long intergenic non-protein coding RNA 1426;lincRNA-uc002yug.2','human','REID0075','Not Found.','>NC_000021.9:34745825-34784886 LINC01426 [organism=Homo sapiens] [GeneID=100506385] [chromosome=21]',' In vitro assay revealed that knockdown of LINC01426 suppressed glioma cells proliferation, migration and invasion, and induced apoptosis.',75),('EL000076','MIR7-3HG','NONHSAT060641.2','284424','MIR7-3 host gene;Huh7; PGSF1; C19orf30; LINC00306; NCRNA00306; uc002mbe.2','human','REID0076','Not Found.','>NC_000019.10:4769105-4772556 MIR7-3HG [organism=Homo sapiens] [GeneID=284424] [chromosome=19]','LncRNA MIR7-3HG executes a positive role in retinoblastoma progression via modulating miR-27a-3p/PEG10 axis. Knockdown of MIR7-3HG reduced the activity of Rb cells and increased the apoptosis of Rb cells, and vice versa.',76),('EL000077','PCAT14','NONHSAT192131.1','101978785','prostate cancer associated transcript 14','human','REID0077','Not Found.','>NC_000022.11:23538102-23547306 PCAT14 [organism=Homo sapiens] [GeneID=101978785] [chromosome=22]','Long noncoding RNA PCAT-14 induces proliferation and invasion by  hepatocellular carcinoma cells by inducing methylation of miR-372.',77),('EL000078','PCAT6','NONHSAT008851.2','100506696','prostate cancer associated transcript 6;PCAN-R1; KDM5BAS1; ncRNA-a2; KDM5B-AS1; onco-lncRNA-96','human','REID0078','Not Found.','>NC_000001.11:202810946-202811913 PCAT6 [organism=Homo sapiens] [GeneID=100506696] [chromosome=1]','PCAT6 knockdown significantly inhibited cellular proliferation and metastasis, as well as induced early apoptosis of lung cancer cells.',78),('EL000079','HEIH',' NONHSAT203709.1','100859930','hepatocellular carcinoma up-regulated EZH2-associated long non-coding RNA ;HCCAT2; LINC-HEIH; LINC00848; lncRNA-HEIH','human','REID0079','Not Found.','>NC_000005.10:c180831618-180829954 HEIH [organism=Homo sapiens] [GeneID=100859930] [chromosome=5]','LncRNA-HEIH suppresses HCC cell growth and metastasis by up-regulating miR-199a-3p. ',79),('EL000080','MIR155HG',' NONHSAT081499.2','114614','MIR155 host gene;BIC; MIRHG2; miPEP155; NCRNA00172','human','REID0080','This gene represents a microRNA host gene. The long RNA transcribed from this gene is expressed at high levels in lymphoma and may function as an oncogene.','>NC_000021.9:25562145-25575168 MIR155HG [organism=Homo sapiens] [GeneID=114614] [chromosome=21]','the expression of MIR155HG was remarkably strong in PC tumor tissue and cell lines against adjacent normal tissue and cells. knockdown of MIR115HG strongly inhibited the cell proliferation, induced the cell cycle arrest, and further promoted the cell apoptosis in PC cells. The expression of miR-802 inhibitor partially reversed the knocking down effect of MIR115HG. ',80),('EL000081','MSC-AS1','NONHSAT215952.1','100132891','MSC antisense RNA 1','human','REID0081','Not Found.','>NC_000008.11:71843123-72056312 MSC-AS1 [organism=Homo sapiens] [GeneID=100132891] [chromosome=8]','MSC-AS1 was obviously upregulated in HCC tissues and HCC cells. Knockdown of MSC-AS1 repressed HepG2 and BEL-7404 cell proliferation, colony formation capacity, and triggered cell apoptosis.',81),('EL000082','EIF3J-DT','Not Found.','645212','EIF3J divergent transcript;EIF3J-AS1','human','REID0082','Not Found.','>NC_000015.10:c44536923-44534505 EIF3J-DT [organism=Homo sapiens] [GeneID=645212] [chromosome=15]','H3K27 acetylationinduced lncRNA EIF3JAS1 improved proliferation and impeded apoptosis of colorectal cancer through miR3163/YAP1 axis. The silence of EIF3JAS1 led to reduced proliferation and facilitated apoptosis of colorectal cancer cells.',82),('EL000083','HOXA11-AS','NONHSAT119704.2','221883','HOXA11 antisense RNA;HOXA11S; HOXA-AS5; HOXA11AS; HOXA11-AS1; NCRNA00076','human','REID0083','This gene produces a long non-coding RNA in antisense to transcription of the homeobox A11 gene. This transcript may associate with chromatin factors such as Polycomb repressive complex and act as a sponge for microRNAs, thereby participating in the regulation of expression of target genes. High levels of this transcript may be associated with tumor progression.','>NC_000007.14:27185408-27189293 HOXA11-AS [organism=Homo sapiens] [GeneID=221883] [chromosome=7]','Knockdown of HOXA11-AS inhibits Nonsmall cell lung cancer cell proliferation and invasion.LncRNA HOXA11-AS promotes proliferation and invasion by targeting miR-124 in human non-small cell lung cancer cells.',83),('EL000084','PDCD4?AS1','Not Found.','282997','PDCD4 antisense RNA 1?','human','REID0084','Not Found.','>NC_000010.11:c110870904-110868890 PDCD4-AS1 [organism=Homo sapiens] [GeneID=282997] [chromosome=10]','lncRNA PDCD4-AS1 as a tumor suppressor in triple negative breast cancerTNBC by regulating IQGAP2 expression via miR-10b-5p.',84),('EL000085','RBM5-AS1','NONHSAT089783.2','100775107','RBM5 antisense RNA 1?;LUST','human','REID0085','This gene produces a non-coding RNA in antisense to the RNA binding motif protein 5 (RBM5) gene. This transcript interacts with beta catenin and may regulate expression of WNT target genes.','>NC_000003.12:c50100988-50099603 RBM5-AS1 [organism=Homo sapiens] [GeneID=100775107] [chromosome=3]',' LncRNA RBM5-AS1 was overexpressed in the Osteosarcoma(Os) tissues and cell lines. And lncRNA RBM5-AS1 promoted Os cell proliferation, migration, and invasion in vitro and tumor growth in vivo. knockdown of RBM5-AS1 significantly inhibited proliferation, migration, and invasion of Os cells in vitro as well as tumor growth in vivo.',85),('EL000086','MIAT ','NONHSAT192181.1','440823','myocardial infarction associated transcript;RNCR2; GOMAFU; C22orf35; LINC00066; NCRNA00066; lncRNA-MIAT','human','REID0086','This gene encodes a spliced long non-coding RNA that may constitute a component of the nuclear matrix. Altered expression of this locus has been reported to be associated with a susceptibility to myocardial infarction. It has also been proposed that pathways involving this transcript may contribute to the pathophysiology of schizophrenia. A similar gene in mouse has been associated with retinal cell fate determination. Alternatively spliced transcript variants have been identified.','>NC_000022.11:26657482-26676478 MIAT [organism=Homo sapiens] [GeneID=440823] [chromosome=22]',' Knocking down MIAT resulted in decreased cell proliferation, migration and invasion of cervical cancer cells, as well as suppression of tumor growth.',86),('EL000087','FOXD2-AS1','NONHSAT003081.2','84793','FOXD2 adjacent opposite strand RNA 1','human','REID0087','Not Found.','>NC_000001.11:c47434641-47432133 FOXD2-AS1 [organism=Homo sapiens] [GeneID=84793] [chromosome=1]','Long noncoding RNA FOXD2-AS1 aggravates hepatocellular carcinoma tumorigenesis by regulating the miR-206/MAP3K1 axis. the inhibition of FOXD2-AS1 repressed HCC cell proliferation, enhanced cell apoptosis, and restrained cell invasion and migration. the knockdown of FOXD2-AS1 inhibited HCC progression by modulating the miR-206/MAP3K1 axis.',87),('EL000088','LINC00707','NONHSAT011260.2','100507127','long intergenic non-protein coding RNA 707','human','REID0088','Not Found.','>NC_000010.11:6779598-6842906 LINC00707 [organism=Homo sapiens] [GeneID=100507127] [chromosome=10]','Knockdown of LINC00707 expression significantly inhibited LoVo and HCT116 cell proliferation, migration, and invasion. LINC00707 acted as a molecular sponge by competing for miR-206 and indirectly modulating the expression of its targets, NOTCH3 and TM4SF1.',88),('EL000089','PCAT7',' NONHSAT219853.1','101928099','prostate cancer associated transcript 7;PCAN-R2','human','REID0089','Not Found.','>NC_000009.12:94555045-94568756 PCAT7 [organism=Homo sapiens] [GeneID=101928099] [chromosome=9]','PCAT7 Induces Poor Prognosis and Promotes Tumorigenesis by Inhibiting mir-134-5p in Non-Small-Cell Lung.Overexpression of PCAT7 resulted in the promotion of tumor cell proliferation, inhibition of cells apoptosis, facilitation of cells metastasis, and formation of EMT phenotype, while PCAT7 expression deletion remarkably prohibited cell proliferation, accelerated their apoptosis, weakened metastasis, and reversed EMTepithelial-to-mesenchymal transition to MET.',89),('EL000090','CDKN2B-AS1','NONHSAT130416.2','100048912','CDKN2B antisense RNA 1;ANRIL; p15AS; PCAT12; CDKN2BAS; CDKN2B-AS; NCRNA00089','human','REID0090','This gene is located within the CDKN2B-CDKN2A gene cluster at chromosome 9p21. The gene product is a functional RNA molecule that interacts with polycomb repressive complex-1 (PRC1) and -2 (PRC2), leading to epigenetic silencing of other genes in this cluster. This region is a significant genetic susceptibility locus for cardiovascular disease, and has also been linked to a number of other pathologies, including several cancers, intracranial aneurysm, type-2 diabetes, periodontitis, Alzheimer\'s disease, endometriosis, frailty in the elderly, and glaucoma. Multiple alternatively processed transcript variants have been detected, some of which may take the form of circular RNA molecules ','>NC_000009.12:21994791-22121097 CDKN2B-AS1 [organism=Homo sapiens] [GeneID=100048912] [chromosome=9]','Knockdown of long non?coding RNA ANRIL inhibits the proliferation and promotes the apoptosis of Burkitt lymphoma cells through the TGF?1 signaling pathway.',90),('EL000091','ELFN1-AS1','NONHSAT118766.2','101927125','ELFN1 antisense RNA 1 ;MYCLo-2','human','REID0091','Not Found.','>NC_000007.14:c1742310-1738630 ELFN1-AS1 [organism=Homo sapiens] [GeneID=101927125] [chromosome=7]','The lncRNA ELFN1-AS1 was significantly up-regulated in ESCA(esophageal cancer) tissues and cell lines when compared with the counterparts. Down-regulation of ELFN1-AS1 restrained cell proliferation, migration, and invasion of ESCA in vitro. lncRNA ELFN1-AS1 facilitates the progression of ESCA by acting as a competing endogenous RNA (ceRNA) to promote GFPT1 expression via sponging miR-183-3p.',91),('EL000092','KTN1-AS1',' NONHSAT037015.2','100129075','KTN1 antisense RNA 1;MYCLo-3; C14orf33','human','REID0092','Not Found.','>NC_000014.9:c55580092-55576157 KTN1-AS1 [organism=Homo sapiens] [GeneID=100129075] [chromosome=14]','KTN1-AS1 knockdown inhibited cell growth and proliferation, increased apoptosis, and modulated the expression of cell cycle- and apoptosis-related proteins (cyclin A1, cyclin-dependent kinase 2, Bcl2, and Bax) in NSCLC cell lines.',92),('EL000093',' SBF2-AS1','NONHSAT017939.2','283104','SBF2 antisense RNA 1','human','REID0093','Not Found.','>NC_000011.10:9758293-9811319 SBF2-AS1 [organism=Homo sapiens] [GeneID=283104] [chromosome=11]','knockdown of SBF2-AS1 significantly inhibited HCC(hepatocellular carcinoma) cells proliferation, migration and invasion.',93),('EL000094','AFAP1-AS1','NONHSAT095059.2','84740','AFAP1 antisense RNA 1;AFAP1AS; AFAP1-AS','human','REID0094','This gene produces a long non-coding RNA that is overexpressed in tumor cells and may promote cancer cell metastasis. ','>NC_000004.12:7754090-7778928 AFAP1-AS1 [organism=Homo sapiens] [GeneID=84740] [chromosome=4]','In vitro experiments demonstrated that AFAP1-AS1 knockdown significantly inhibited the cell invasive and migration capability in lung cancer cells. AFAP1-AS1 knockdown also increased the expression of its antisense protein coding gene, actin filament associated protein 1(AFAP1), and affected the expression levels of several small GTPase family members and molecules in the actincytokeratin signaling pathway, which suggested that AFAP1-AS1 promoted cancer cell metastasis via regulation of actin filament integrity. ',94),('EL000095','HNF1A-AS1',' NONHSAT232446.1','283460','HNF1A antisense RNA 1;HAS1; C12orf27; NCRNA00262','human','REID0095','Not Found.','>NC_000012.12:c120972292-120969838 HNF1A-AS1 [organism=Homo sapiens] [GeneID=283460] [chromosome=12]','knockdown of HNF1A-AS1 expression notably inhibited CRC colorectal carcinoma cell proliferation, migration, invasion and colony formation, and suppressed S-phase entry in vitro.',95),('EL000096','LPP-AS2',' NONHSAT247078.1','339929',' LPP antisense RNA 2;MYCLo-5; MYCLo-6','human','REID0096','Not Found.','>NC_000003.12:c188154088-188151206 LPP-AS2 [organism=Homo sapiens] [GeneID=339929] [chromosome=3]','Long non-coding RNA LPP-AS2 promotes glioma tumorigenesis via miR-7-5p/EGFR/PI3K/AKT/c-MYC feedback loop. LPP-AS2 depletion inhibited glioma cell proliferation, invasion and promoted apoptosisin vitro and restrained tumor growth in vivo, overexpression of LPP-AS2 resulted in the opposite effects.',96),('EL000097','MNX1-AS1',' NONHSAT253820.1','645249','MNX1 antisense RNA 1;MAYA; CCAT5','human','REID0097','Not Found.','>NC_000007.14:157010857-157016424 MNX1-AS1 [organism=Homo sapiens] [GeneID=645249] [chromosome=7]','Long non-coding RNA MNX1-AS1 promoted osteosarcoma proliferation and invasion via inhibiting KISS1.MNX1-AS1 was higher-expressed in osteosarcoma samples than that in adjacent tissues. The abilities of proliferation and invasion were suppressed after MNX1-AS1 was knocked down in vitro.',97),('EL000098','TP73-AS1',' NONHSAT000530.2','57212','TP73 antisense RNA 1;PDAM; KIAA0495','human','REID0098','Not Found.','>NC_000001.11:c3747373-3735984 TP73-AS1 [organism=Homo sapiens] [GeneID=57212] [chromosome=1]','TP73-AS1 could promote tumor growth and nvasion by acting as a ceRNA to promote GOLM1 expression by sponging miR-128-3p in PC pancreatic cancer).TP73-AS1 silencing inhibited PC cell proliferation, migration, and invasion in vitro as well as suppressed tumor growth in vivo.',98),('EL000099',' LINC00473',' NONHSAT116018.2','90632','long intergenic non-protein coding RNA 473;LNC473; C6orf176; bA142J11.1','human','REID0099','Not Found.','>NC_000006.12:c165988039-165924048 LINC00473 [organism=Homo sapiens] [GeneID=90632] [chromosome=6]',' knockdown of LINC00473 resulted in the suppression of tumor cell proliferation, promotion of cells apoptosis, inhibition of cells metastasis.',99),('EL000100','LINC00673','NONHSAT055686.2','100499467',' long intergenic non-protein coding RNA 673;SLNCR; SLNCR1; ERRLR01; HILNC75; LUCAIR1; HI-LNC75','human','REID0100','This gene produces a long non-protein coding RNA that is involved in the regulation of gene expression during tumor progression. This transcript can promote cell proliferation in gastric cancer through interaction with enhancer of zeste 2 and other epigenetic suppressors of gene expression, thereby downregulating target genes including Kruppel like factors 2 and 4. This transcript may also act as a tumor suppressor by promoting interaction between protein tyrosine phosphatase, non-receptor type 11 (Ptpn11) and ubiquitin ligase, resulting in degradation of Ptpn11 and lowered oncogenic signalling. Naturally-occurring variation at this locus results in the formation of a binding site for miR-1231, which negatively regulates activity of this transcript. Alternative splicing results in multiple transcript variants.','>NC_000017.11:c72592804-72403322 LINC00673 [organism=Homo sapiens] [GeneID=100499467] [chromosome=17]','Linc00673 knockdown significantly inhibited cell proliferation and colony-forming ability, and suppressed S-phase entry in vitro and shRNA linc00673 mediated knockdown significantly inhibit tumor growth in vivo, meanwhile, linc00673 overexpression increased tumor cell growth. linc00673 could modulate the transcription of a large amount of genes including oncogene and tumor suppressor gene.',100),('EL000101','LINC00364','NONHSAT034220.2','100874145','long intergenic non-protein coding RNA 364;LncRNA00364','human','REID0101','Not Found.','>NC_000013.11:67372387-67379994 LINC00364 [organism=Homo sapiens] [GeneID=100874145] [chromosome=13]',' LncRNA00364 displays lower expression in HCC tumor samples compared to paired normal controls. Overexpression of LncRNA00364 inhibits cell proliferation, G1/S cell cycle progression and promotes apoptosis in HCC cell lines. Consistently, LncRNA00364 overexpression leads to decreased HCC tumor formation in vivo. Mechanistically, LncRNA00364 specifically binds with STAT3, resulting in inhibition of STAT3 phosphorylation and therefore leads to upregulation of IFIT2. In a clinical setting, LncRNA00364 shows an independent prognostic indicator for overall survival and cumulative recurrence in HCC patients, and correlates with IFIT2. ',101),('EL000102','LINC00628',' NONHSAT008940.2','127841','long intergenic non-protein coding RNA 628 ','human','REID0102','Not Found.','>NC_000001.11:c204369719-204368430 LINC00628 [organism=Homo sapiens] [GeneID=127841] [chromosome=1]','The expression of LINC00628 was decreased in breast cancer. The overexpression of LINC00628 suppressed the proliferation, invasion and migration of breast cancer cells and promoted cell apoptosis associated with the regulation of Bcl-2/Bax/Caspase-3 signal pathway.',102),('EL000103','NNT-AS1',' NONHSAT101321.2','100652772','NNT antisense RNA 1 ','human','REID0103','Not Found.','>NC_000005.10:c43603230-43573185 NNT-AS1 [organism=Homo sapiens] [GeneID=100652772] [chromosome=5]','NNT-AS1 facilitated proliferation, migration, invasion and EMT of NSCLC(non-small cell lung cancer) cells by sponging miR-22-3p and regulating YAP1 expression.NNT-AS1 knockdown impeded proliferation, migration, invasion and EMT of NSCLC cells.',103),('EL000104','AGAP2-AS1','NONHSAT162285.1','100130776',' AGAP2 antisense RNA 1;PUNISHER','human','REID0104','Not Found.','>NC_000012.12:57726240-57728356 AGAP2-AS1 [organism=Homo sapiens] [GeneID=100130776] [chromosome=12]','downregulation of AGAP2-AS1 depressed cell proliferation, migration, and invasion, and promoted cell apoptosis in GBM(glioblastoma multiforme). In summary, AGAP2-AS1 is a prognostic biomarker for patients with GBM, and functions as an oncogenic lncRNA to modulate GBM cell proliferation, apoptosis, migration, and invasion, which suggests that AGAP2-AS1 is potential therapeutic target for GBM.',104),('EL000105','BABAM2-AS1','Not Found.','100302650','BABAM2 antisense RNA 1;BRE-AS1','human','REID0105','Not Found.','>NC_000002.12:c27891114-27889456 BABAM2-AS1 [organism=Homo sapiens] [GeneID=100302650] [chromosome=2]','LncRNA BRE-AS1 showed significantly decreased expression in BC tissues than the paired normal tissues. In vitro experiments demonstrated that over-expression of lncRNA BRE-AS1 inhibited cell proliferation but promoted cell apoptosis of EJ and T24 cells. STAT3 was determined as a target for lncRNA BRE-AS1. In vivo, up-regulation of lncRNA BRE-AS1 reduced cancer growth in nude mice bearing BC via repressing the phosphorylation of STAT3.',105),('EL000106','FEZF1-AS1',' NONHSAT123027.2','154860','FEZF1 antisense RNA 1 ','human','REID0106','Not Found.','>NC_000007.14:122303658-122310077 FEZF1-AS1 [organism=Homo sapiens] [GeneID=154860] [chromosome=7]','the downregulation of FEZF1-AS1 expression significantly inhibited the CRC cells proliferation, migration and invasiveness, suppressed S-phase entry in vitro, and repressed tumor growth and metastasis in vivo. In contrast, overexpression of FEZF1-AS1 could promote the aggressive behaviors of CRC cells.FEZF1 knockdown also significantly suppressed CRC cell proliferation, migration, and invasion. ',106),('EL000107','ZEBTR ','Not Found.','113391337',' ZEB1 transcriptional regulator RNA ;BX111','human','REID0107','Not Found.','Not Found.',' knockdown or overexpression of BX111 dramatically repressed or enhanced proliferation and invasion of pancreatic cancer cells.Mechanically, BX111 activated transcription of ZEB1, a key regulator for epithelia-mesenchymal transition (EMT), via recruiting transcriptional factor Y-box protein (YB1) to its promoter region. Moreover, we revealed that BX111 transcription was induced by hypoxia-inducible factor (HIF-1) in response to hypoxia. In addition, BX111 contributed to the hypoxia-induced EMT of pancreatic cells by regulating expression of ZEB1 and its downstream proteins E-cadherin and MMP2. Coincidence with in vitro results, BX111 depletion effectively inhibited growth and metastasis of xenograft tumor in vivo. ',107),('EL000108','SNHG5 ',' NONHSAT113854.2','60674','growth arrest specific 5 ;SNHG2; NCRNA00030','human','REID0108','This gene produces a spliced long non-coding RNA and is a member of the 5\' terminal oligo-pyrimidine class of genes. It is a small nucleolar RNA host gene, containing multiple C/D box snoRNA genes in its introns. Part of the secondary RNA structure of the encoded transcript mimics glucocorticoid response element (GRE) which means it can bind to the DNA binding domain of the glucocorticoid receptor (nuclear receptor subfamily 3, group C, member 1). This action blocks the glucocorticoid receptor from being activated and thereby stops it from regulating the transcription of its target genes. This transcript is also thought to regulate the transcriptional activity of other receptors, such as androgen, progesterone and mineralocorticoid receptors, that can bind to its GRE mimic region. Multiple functions have been associated with this transcript, including cellular growth arrest and apoptosis. It has also been identified as a potential tumor suppressor, with its down-regulation associated with cancer in multiple different tissues.','>NC_000001.11:c173868882-173863899 GAS5 [organism=Homo sapiens] [GeneID=60674] [chromosome=1]',' GAS5 transcript level was significantly reduced in breast cancer tissues relative to normal breast epithelial tissues, and overexpression of GAS5 could induce growth arrest and apoptosis of human breast cancer cell lines .In addition, low expression level of GAS5 disadvantageously impacted patient prognosis, suggesting that GAS5 may act as a tumor suppressor in breast cancer.',108),('EL000109','PTCSC1 ','Not Found.','100302522',' papillary thyroid carcinoma susceptibility candidate 1;PTCSC; NCRNA00197','human','REID0109','Not Found.','>NC_000008.11:133054959-133057767 PTCSC1 [organism=Homo sapiens] [GeneID=100302522] [chromosome=8]','AK023948 was substantially upregulated in tumor tissues. Meanwhile, higher AK023948 expression correlated with poor survival. Upregulation of AK023948 expression can promote HepG2 and Hep3B proliferation and invasion in in vitro experiments. Furthermore, AK023948 also decreased tumor growth in vivo. ',109),('EL000110','NKILA','NONHSAT243526.1','105416157','NF-kappaB interacting lncRNA','human','REID0110','Not Found.','>NC_000020.11:57710183-57712780 NKILA [organism=Homo sapiens] [GeneID=105416157] [chromosome=20]','NKILA-inhibited rectal cancer cell proliferation, migration, and invasion via suppressing NF-B signaling.',110),('EL000111','CAMTA1-DT','Not Found.','110841581',' CAMTA1 divergent transcript ;lncCAMTA1','human','REID0111','Not Found.','>NC_000001.11:c6784980-6783892 CAMTA1-DT [organism=Homo sapiens] [GeneID=110841581] [chromosome=1]','The results showed that lncCAMTA1 expression promoted cell viability and migration/invasion, while knockdown of lncCAMTA1 promoted cell apoptosis via binding with miR-20b. lncCAMTA1 negatively regulated miR-20b expression. VEGF was a target of miR-20b, leading to the modification of the phosphorylation levels of MAPK, ERK, JAK, STAT1, and STAT3. lncCAMTA1 might promote proliferation and mobility of human breast cancer cells via binding with miR-20b. VEGF was a direct target of miR-20b and regulated activation of the MAPK/ERK and JAK/STAT3 signaling pathways. ',111),('EL000112','NBAT1 ',' NONHSAT252041.1','729177','neuroblastoma associated transcript 1;CASC14; NBAT-1','human','REID0112','Not Found.','>NC_000006.12:c22147193-22134602 NBAT1 [organism=Homo sapiens] [GeneID=729177] [chromosome=6]',' The expression level of lncRNA NBAT-1 in cancer specimen was remarkably lower than that in adjacent areas. Furthermore, the low expression of lncRNA NBAT-1 had a significant correlation with patient\'s tumor size, differentiation degree of tumor cells and lymph node metastasis. The overexpression of lncRNA NBAT-1 could inhibit the proliferation and cell cycle, promote the apoptosis of A549 cells, and down-regulate the expression level of RAC1.',112),('EL000113','PACERR',' NONHSAT150184.1','103752588',' PTGS2 antisense NFKB1 complex-mediated expression regulator RNA;PACER; PTGS2AS1; PTGS2-AS1','human ','REID0113','This gene represents transcription of a long non-coding RNA produced in antisense to the prostaglandin-endoperoxide synthase 2 (PTGS2) gene. This transcript interacts with NF-kB transcriptional regulators to promote expression of PTGS2.','>NC_000001.11:186680654-186681446 PACERR [organism=Homo sapiens] [GeneID=103752588] [chromosome=1]','PACER was down-regulated and HOTAIR was up-regulated in OA. PACER overexpression may improve OA by inhibiting the apoptosis of chondrocyte through the down-regulation of lncRNA HOTAIR.',113),('EL000114','NRON',' NONHSAT134764.2','641373','non-coding repressor of NFAT;NCRNA00194','human','REID0114','Not Found.','>NC_000009.12:c126410504-126407775 NRON [organism=Homo sapiens] [GeneID=641373] [chromosome=9]','LncNRON overexpression can suppress HCC growth and metastasis via inhibiting the EMT',114),('EL000115','SPRY4IT1',' NONHSAT204811.1','100642175','SPRY4 intronic transcript 1 ;SPRIGHTLY','human','REID0115','This gene produces a non-coding RNA that is upregulated in several different tumors, including melanoma and breast and prostate cancer cells. This transcript may mediate cell growth, proliferation, and apoptosis. It regulates levels of lipin 2, and therefore may be involved in lipid biosynthesis. The primary transcript is cleaved to release a mature product that localizes to the cytoplasm (PMID:25344859). The full length structure of the primary and cleaved transcripts is unclear, and it is possible that the primary transcript is a splice variant of SPRY4 (sprouty RTK signaling antagonist 4). ','>NC_000005.10:c142318322-142317620 SPRY4-IT1 [organism=Homo sapiens] [GeneID=100642175] [chromosome=5]','SPRY4-IT1 promotes proliferation and stemness of breast cancer cells as well as renewal ability and stemness maintenance of BCSCs by increasing the expression of TCF7L2 through targeting miR-6882-3p.SPRY4-IT1 overexpression promoted breast cancer cell proliferation and stemness in vitro and in vivo.SPRY4-IT1 knockdown suppressed BCSC(breast cancer stem cell) renewal ability and stemness maintenance in vivo and in vitro.',115),('EL000116','FGF14AS2','NONHSAT035000.2','283481',' FGF14 antisense RNA 2 ','human ','REID0116','Not Found.','>NC_000013.11:102394578-102395705 FGF14-AS2 [organism=Homo sapiens] [GeneID=283481] [chromosome=13]','Long non-coding RNA FGF14-AS2 represses proliferation, migration, invasion, and induces apoptosis in breast cancer by sponging miR-205-5p.the overexpression of FGF14-AS2 or miR-205-5p knockdown suppressed proliferation, migration, and invasion, and induced apoptosis of breast cancer cells. ',116),('EL000117','FGF13-AS1','NONHSAT138767.2','100129662','FGF13 antisense RNA 1 ','human','REID0117','Not Found.','>NC_000023.11:138712107-138716605 FGF13-AS1 [organism=Homo sapiens] [GeneID=100129662] [chromosome=X]','Long non-coding RNA FGF13-AS1 inhibits glycolysis and stemness properties of breast cancer cells through FGF13-AS1/IGF2BPs/Myc feedback loop.',117),('EL000118','IATPR ','Not Found.','101929447','ITGB1 adjacent tumor promoting lncRNA;linc-ITGB1; TCONS_00018476','human','REID0118','Not Found.','>NC_000010.11:c33116807-33074026 IATPR [organism=Homo sapiens] [GeneID=101929447] [chromosome=10]',' linc-ITGB1 promotes breast cancer progression by inducing cell cycle arrest and interrupting the epithelial-to-mesenchymal transition process.The linc-ITGB1 knockdown with specific short hairpin RNA (shRNA) decreased cell proliferation and colony formation in vitro. Tumor growth in vivo was also inhibited by linc-ITGB1 depletion. In addition, linc-ITGB1 depletion caused cell accumulation in the G0/G1 phase.',118),('EL000119','SPRY4-IT1',' NONHSAT204811.1','100642175','SPRY4 intronic transcript 1;SPRIGHTLY','human','REID0119','This gene produces a non-coding RNA that is upregulated in several different tumors, including melanoma and breast and prostate cancer cells. This transcript may mediate cell growth, proliferation, and apoptosis. It regulates levels of lipin 2, and therefore may be involved in lipid biosynthesis. The primary transcript is cleaved to release a mature product that localizes to the cytoplasm (PMID:25344859). The full length structure of the primary and cleaved transcripts is unclear, and it is possible that the primary transcript is a splice variant of SPRY4 (sprouty RTK signaling antagonist 4).','>NC_000005.10:c142318322-142317620 SPRY4-IT1 [organism=Homo sapiens] [GeneID=100642175] [chromosome=5]','SPRY4-IT1 is upregulated in pancreatic ductal adenocarcinoma both in tissues and cells.Silencing of SPRY4-IT1 significantly inhibits cell growth both?in vitro?and?in vivo. Additionally, decreased SPRY4-IT1 contributed to tumor suppressive effect through attenuating cell growth, clonogenic ability and facilitating apoptosis?via?Bcl-2/caspase-3 pathway in PANC1 and Capan-2 cells.?',119),('EL000120','DLEU7-AS1',' NONHSAT033866.2','100874074','DLEU7 antisense RNA 1','human','REID0120','Not Found.','>NC_000013.11:50807855-50849905 DLEU7-AS1 [organism=Homo sapiens] [GeneID=100874074] [chromosome=13]','The expression of DLEU7-AS1 is significantly increased in CRC, which is markedly associated with CRC staging, lymph node metastasis, distant metastasis and poor prognosis. DLEU7-AS1 may promote the proliferation, invasion and migration capacities of CRC through regulating the Wnt/-catenin pathway.',120),('EL000121','ASAP1-IT1','NONHSAT129152.2','29065','ASAP1 intronic transcript 1ASAP1IT; HSPC054; ASAP1-IT; ASAP1IT1; DDEF1IT1; NCRNA00050','human','REID0121','Not Found.','>NC_000008.11:c130296533-130295355 ASAP1-IT1 [organism=Homo sapiens] [GeneID=29065] [chromosome=8]',' the expression of ASAP1-IT1 is relatively upregulated in NSCLC cells and tissues, which can promote the proliferation, invasion and metastasis of NSCLC cells through regulating the PTEN/AKT signal pathway.',121),('EL000122','BANCR ','NONHSAT131775.2','100885775','BRAF-activated non-protein coding RNA;LINC00586','human','REID0122','This gene produces a long non-coding RNA that plays a role in tumor progression and epithelial to mesenchymal transition. This transcript acts through the MAP kinase signaling pathway. ','>NC_000009.12:c69307056-69296681 BANCR [organism=Homo sapiens] [GeneID=100885775] [chromosome=9]','LncRNA BANCR is highly expressed in breast cancer, which is significantly correlated with the prognosis of patients; moreover, it can promote the growth, invasion and metastasis of ovarian cancer cells. The down-regulation of BANCR can inhibit the proliferation, invasion and metastasis capacities of MCF-7 cells.',122),('EL000123','PCA3','NONHSAT131964.2','50652','prostate cancer associated 3 ;DD3; PCAT3; NCRNA00019; PRUNE2-AS1','human','REID0123','This gene produces a spliced, long non-coding RNA that is highly overexpressed in most types of prostate cancer cells and is used as a specific biomarker for this type of cancer. This gene is embedded in an intronic region of the prune2 gene on the opposite DNA strand. The transcript regulates prune2 levels through formation of a double-stranded RNA that undergoes adenosine deaminase acting on RNA-dependent adenosine-to-inosine RNA editing. In prostate cancer derived cells, overexpression of PCA induced downregulation of prune2, leading to decreased cell proliferation. Conversely, silencing in prostate cancer cells resulted in increased proliferation. Regulation of this gene appears to be sensitive to androgen-receptor activation, a molecular signature of prostate cancer. Alternative splicing results in multiple transcript variants. ','>NC_000009.12:76764436-76787569 PCA3 [organism=Homo sapiens] [GeneID=50652] [chromosome=9]','?lncRNA PCA3 may coordinate EOC (epithelial ovarian carcinoma?) tumorigenesis through disrupting miR-106b regulated gene expression.?siRNA?knockdown of PCA3 markedly inhibited?cell viability, induced?G1 phase arrest, and led to apoptosis in ovarian cancer cells.?',123),('EL000124','SChLAP1',' NONHSAT183221.1','101669767',' SWI/SNF complex antagonist associated with prostate cancer 1;PCAT11; PCAT114; LINC00913','human','REID0124','Not Found.','>NC_000002.12:180692104-180916939 SCHLAP1 [organism=Homo sapiens] [GeneID=101669767] [chromosome=2]','SChLAP1 was overexpressed in bladder cancer tissues compared to paired normal bladder tissues. Cell growth arrest, apoptosis induction and migration inhibition were also observed in bladder cancer T24 and 5637 cells after transfection with SChLAP1 siRNA.',124),('EL000125','SNHG20 ',' NONHSAT056107.2','654434','small nucleolar RNA host gene 20;C17orf86; LINC00338; NCRNA00338; SCARNA16HG','human','REID0125','Not Found.','>NC_000017.11:77088643-77094986 SNHG20 [organism=Homo sapiens] [GeneID=654434] [chromosome=17]','SNHG20 knockdown suppresses proliferation, migration and invasion, and promotes apoptosis in non-small cell lung cancer through acting as a miR-154 sponge.',125),('EL000126',' GAPLINC','NONHSAT056996.2','100505592','gastric adenocarcinoma associated, positive CD44 regulator, long intergenic non-coding RNA;LINC01540','human','REID0126','Not Found.','>NC_000018.10:3466250-3478978 GAPLINC [organism=Homo sapiens] [GeneID=100505592] [chromosome=18]','GAPLINC expression was significantly up-regulated in both GBM tissues and cell lines. The overexpression of GAPLINC was associated with shorter overall survival and disease-free survival. Functional assays indicated that GAPLINC silencing suppressed GBM cells proliferation, migration, and invasion, and promoted apoptosis. In the mechanism,GAPLINC acted as a competing endogenous RNA to sponge miR-331-3p and knockdown of GAPLINC promoted the expression of miR-331-3p.',126),('EL000127','BLACAT1','Not Found.','101669762','bladder cancer associated transcript 1;LINC00912; linc-UBC1; onco-lncRNA-30','human','REID0127','Not Found.','>NC_000001.11:c205456086-205434886 BLACAT1 [organism=Homo sapiens] [GeneID=101669762] [chromosome=1]','Long noncoding RNA BLACAT1 is overexpressed in hepatocellular carcinoma and its downregulation suppressed cancer cell development through endogenously competing against hsa-miR-485-5p.',127),('EL000128','DLEU2',' NONHSAT033777.2','8847','deleted in lymphocytic leukemia 2 ;ALT1; DLB2; LEU2; RFP2; BCMSUN; RFP2OS; MIR15AHG; TRIM13OS; LINC00022; NCRNA00022','human','REID0128','This locus represents a microRNA host gene and also produces long alternatively spliced non-coding RNAs. This genome region was observed to be deleted or epigenetically suppressed in leukemia, and was implicated as a negative regulator of cell proliferation. However, an alternative transcript produced at this locus was also found to promote progression through the cell cycle via angiotensin I converting enzyme 2 and cyclin D1. ','>NC_000013.11:c50125541-49982549 DLEU2 [organism=Homo sapiens] [GeneID=8847] [chromosome=13]','The expression of long non-coding RNA (lncRNA) DLEU2 was observably high in GC cells and tissues. DLEU2 silence depressed the capacities of proliferation, migration and invasion but promoted apoptosis in GC cells. Moreover, DLEU2 was activated by signal transducer and activator of transcription 1 (STAT1) and sequestered microRNA-23b-3p (miR-23b-3p) to modulate the expression of notch receptor 2 (NOTCH2), thereby stimulating Notch signaling pathway. More importantly, DLEU2 contributed to GC progression via targeting miR-23b-3p/NOTCH2 axis.',128),('EL000129','SOX2-OT',' NONHSAT093469.2','347689','SOX2 overlapping transcript;SOX2OT; NCRNA00043','human','REID0129','This gene produces alternatively spliced long non-coding RNAs. These RNAs were observed to be upregulated in tumor cells and positively correlated to expression of the SRY-box 2 gene. Overexpression of these transcripts may promote cell proliferation. ','v>NC_000003.12:181056680-181742228 SOX2-OT [organism=Homo sapiens] [GeneID=347689] [chromosome=3]','Long Noncoding RNA SOX2-OT Knockdown Inhibits Proliferation and Metastasis of Prostate Cancer Cells Through Modulating the miR-452-5p/HMGB3 Axis and Inactivating Wnt/-Catenin Pathway.',129),('EL000130','FAS-AS1','NONHSAT015489.2','100302740','FAS antisense RNA 1;SAF; FASAS; FAS-AS','human','REID0130','Not Found.','>NC_000010.11:c88992975-88991422 FAS-AS1 [organism=Homo sapiens] [GeneID=100302740] [chromosome=10]','FAS-AS1 suppressed cell proliferation, migration, and invasion by sponging miR-19a-5p in NSCLC(Non-small cell lung cancer).',130),('EL000131','LUCAT1',' NONHSAT102745.2','100505994','lung cancer associated transcript 1 ;SCAL1; SCAT5','human','REID0131','Not Found.','>NC_000005.10:c91314402-91302986 LUCAT1 [organism=Homo sapiens] [GeneID=100505994] [chromosome=5]','LncRNA LUCAT1 contributes to cell proliferation and migration in human pancreatic ductal adenocarcinoma via sponging miR-539.lncRNA LUCAT1 knockdown dramatically suppressed PDAC cell proliferation, induced cell cycle arrest and inhibited cell migration and invasion.',131),('EL000132','TP53COR1 ','Not Found.','102800311','tumor protein p53 pathway corepressor 1;linc-p21; TRP53COR1; lincRNA-p21','human','REID0132','Not Found.','Not Found.','Overexpression of lincRNA-p21 inhibited the GC cell proliferation and increased the radiosensitivity of GC (gastric cancer) cells by regulating the -catenin signaling pathway.?',132),('EL000133','LINC00173',' NONHSAT030944.2','100287569','long intergenic non-protein coding RNA 173;NCRNA00173','human','REID0133','Not Found.','>NC_000012.12:116533422-116536513 LINC00173 [organism=Homo sapiens] [GeneID=100287569] [chromosome=12]',' long intergenic nonprotein coding RNA 173 (LINC00173) was highly expressed in pancreatic cancer tissues. In vitro functional experiments showed that LINC00173 overexpression inhibited the proliferation and invasion of pancreatic cancer cells and promoted cell apoptosis in MIA PaCa-2 and PANC-1 cells. RNA sequencing analysis and Western blot assays demonstrated that LINC00173 reduced the expression of sphingosine kinase 1 (SPHK1) and then inhibited the protein expression of activated phospho-protein kinase B (AKT) and NF-B. In vivo functional assays also revealed that LINC00173 inhibited the growth of pancreatic cancer xenografts, repressed cell proliferation, promoted cell apoptosis, and inhibited SPHK1 expression. The combined results of this study indicate that LINC00173 inhibits pancreatic cancer progression by repressing SPHK1 expression.',133),('EL000134','LINC00857','NONHSAT015237.2','439990','long intergenic non-protein coding RNA 857;HUMT','human','REID0134','Not Found.','>NC_000010.11:80207710-80219657 LINC00857 [organism=Homo sapiens] [GeneID=439990] [chromosome=10]','knockdown of LINC00857 with siRNAs decreased tumor cell proliferation, colony formation, migration and invasion in vitro, as well as tumor growth in vivo. Overexpression of LINC00857 increased cancer cell proliferation, colony formation and invasion. Mechanistic analyses indicated that LINC00857 mediates tumor progression via cell cycle regulation.',134),('EL000135','WWOX-AS1','Not Found.','102724047','WWOX antisense RNA 1','human','REID0135','Not Found.','>NC_000016.10:c78242608-78230135 WWOX-AS1 [organism=Homo sapiens] [GeneID=102724047] [chromosome=16]','A new tumor suppressor lncRNA RP11-190D6.2 inhibits the proliferation, migration, and invasion of epithelial ovarian cancer cells.',135),('EL000136','LUNAR1','NONHSAT171307.1','104564224','leukemia-associated non-coding IGF1R activator RNA 1','human','REID0136','This gene is thought to produce a functional long non-coding RNA. It is regulated by Notch and is overexpressed in T cell acute lymphoblastic leukemia. The transcript acts as a positive regulator of cell division by promoting expression of the insulin-like growth factor type I receptor (IGF1R) gene. ','>NC_000015.10:99014704-99031050 LUNAR1 [organism=Homo sapiens] [GeneID=104564224] [chromosome=15]','LUNAR1 knockdown significantly repressed cell proliferation of DLBCL by regulating E2F1, cyclin D1 and p21. ',136),('EL000137','HOTAIRM1',' NONHSAT119665.2','100506311','HOXA transcript antisense RNA, myeloid-specific 1;HOXA-AS1; HOXA1-AS1; NCRNA00179','human','REID0137','This non-coding locus is located in the HOX gene cluster. Transcription of this locus is induced by retinoic acid, and transcripts likely function in regulation of myelopoiesis through transcriptional activation of several genes in the HOXA cluster, in addition to several beta-2 integrins. ','>NC_000007.14:27096094-27100258 HOTAIRM1 [organism=Homo sapiens] [GeneID=100506311] [chromosome=7]','The silencing of HOTAIRM1 significantly impairs the proliferation, apoptosis, self-renewal, tumorigenesis of GSCs(glioma stem cells ). ',137),('EL000138','FENDRR','NONHSAT144212.2','400550','FOXF1 adjacent non-coding developmental regulatory RNA ;FOXF1AS1; FOXF1-AS1; lincFOXF1; TCONS_00024240; onco-lncRNA-21','human','REID0138','This gene produces a spliced long non-coding RNA transcribed bidirectionally with FOXF1 on the opposite strand. A similar gene in mouse is essential for normal development of the heart and body wall. The encoded transcript is thought to act by binding to polycomb repressive complex 2 (PRC2) and/or TrxG/MLL complexes to promote the methylation of the promoters of target genes, thus reducing their expression. It has been suggested that this transcript may play a role in the progression of gastric cancer. Alternatively spliced transcript variants have been identified. ','>NC_000016.10:c86508860-86474525 FENDRR [organism=Homo sapiens] [GeneID=400550] [chromosome=16]','Long non-coding RNA FENDRR inhibits migration and invasion of cutaneous malignant melanoma cells.FENDRR mediated the metastasis phenotype of MM(malignant melanoma) cells by inhibiting the expressions of MMP2 and MMP9 and antagonizing the JNK/c-Jun pathway.',138),('EL000139',' Gas5','NONMMUT003417.2','14455','growth arrest specific 5 ;Gas; Snh; Gas-5; Snhg2; Mir5117','mouse','REID0139','Not Found.','>NC_000067.7:160862171-160866109 Gas5 [organism=Mus musculus] [GeneID=14455] [chromosome=1]','Gas5 is an essential lncRNA regulator for self-renewal and pluripotency of mouse embryonic stem cells and induced pluripotent stem cells.Knockdown of Gas5 promoted endodermal differentiation of mESCs(mouse embryonic stem cells) and impaired the efficiency of iPSC(induced pluripotent stem cells ) reprogramming.',139),('EL000140','CEBPA-DT','Not Found.','80054','CEBPA divergent transcript ;ADINR; CEBPA-AS1','human','REID0140','Not Found.','>NC_000019.10:33302821-33305057 CEBPA-DT [organism=Homo sapiens] [GeneID=80054] [chromosome=19]','Silence of CEBPA-AS1 inhibited OSCC(Oral squamous cell carcinoma)cells proliferation and induced cells apoptosis, migration and invasion by targeting CEBPA and via a novel pathway CEBPA/Bcl2. ',140),('EL000141','INHBA-AS1','NONHSAT120262.2','285954','INHBA antisense RNA 1 ','human','REID0141','Not Found.','>NC_000007.14:41693919-41779378 INHBA-AS1 [organism=Homo sapiens] [GeneID=285954] [chromosome=7]','NHBA-AS1 downregulation in CRC(colorectal cancer )cells suppressed CRC cell proliferation as well as colony formability. LncRNA INHBA-AS1 promotes colorectal cancer cell proliferation by sponging miR-422a to increase AKT1 axis',141),('EL000142','MIR4435-2HG',' NONHSAT073642.2','541471','MIR4435-2 host gene ;AGD2; MORRBID; LINC00978; MIR4435-1HG; lncRNA-AWPPH','human','REID0142','Not Found.','>NC_000002.12:c111495161-111195866 MIR4435-2HG [organism=Homo sapiens] [GeneID=541471] [chromosome=2]','MIR4435-1HG knockdown inhibited cell proliferation, and suppressed the migrating and invasive capacity of renal carcinoma cells. ',142),('EL000143','THORLNC','Not Found.','100506797','testis associated oncogenic lncRNA;THOR','human','REID0143','Not Found.','>NC_000002.12:c118186386-118182922 THORLNC [organism=Homo sapiens] [GeneID=100506797] [chromosome=2]','THOR could promote HCC cell growth and metastasis by amplifying PTEN/AKT signaling.THOR depletion resulted in significant inhibition of the growth and metastasis of HCC cells.',143),('EL000144','DANCR',' NONHSAT096369.2','57291','differentiation antagonizing non-protein coding RNA;AGU2; ANCR; SNHG13; KIAA0114; lncRNA-ANCR','human','REID0144','This gene produces a long non-coding RNA that functions as a negative regulator of cell differentiation. This transcript associates with enhancer of zeste homolog 2 to repress expression of the runt related transcription factor 2 gene. Increased expression of this transcript may be associated with cancer. Alternatively spliced transcript variants have been observed. ','>NC_000004.12:52712394-52720697 DANCR [organism=Homo sapiens] [GeneID=57291] [chromosome=4]',' the knockdown of lncRNA DANCR inhibited cell proliferation and autophagy of HCC cells. lncRNA DANCR induced cell proliferation, colony formation and autophagy by increasing ATG7 and suppressing miR-222-3p.',144),('EL000145','PCGEM1 ',' NONHSAT076153.2','64002',' PCGEM1 prostate-specific transcript;PCAT9; LINC00071; NCRNA00071','human','REID0145','This gene produces a long non-coding RNA that is overexpressed in prostate cancer and may act a marker for tumor progression. This RNA may act a negative regulator of apoptosis, and may promote activity of androgen receptor and Myc.','>NC_000002.12:192749845-192776899 PCGEM1 [organism=Homo sapiens] [GeneID=64002] [chromosome=2]','LncRNA PCGEM1 was upregulated in glioma tissues and tumor cell lines. PCGEM1 upregulation predicted unsatisfactory prognosis. PCGEM1 knockdown inhibited proliferation, colony formation, migration and invasion. PCGEM1 knockdown delayed tumor growth in vivo. PCGEM1 played as a competing endogenous RNA (ceRNA) for miR-539-5p to promote CDK6 expression. ',145),('EL000146','GAS5-AS1','NONHSAT225709.1','100506046','GAS5 antisense RNA 1 ','human','REID0146','Not Found.','>NC_000001.11:173863248-173863941 GAS5-AS1 [organism=Homo sapiens] [GeneID=100506046] [chromosome=1]',' lncRNA GAS5-AS1 inhibited glioma proliferation, migration, and invasion by sponging miR-106b-5p and regulating the expression of TUSC2.GAS5-AS1 expression was downregulated in glioma tissues and cells, and upregulation of GAS5-AS1 expression inhibited glioma cell proliferation, migration, and invasion. ',146),('EL000147','LINC00525',' NONHSAT120518.2','84847','long intergenic non-protein coding RNA 525 ','human','REID0147','Not Found.','>NC_000007.14:47761476-47766772 LINC00525 [organism=Homo sapiens] [GeneID=84847] [chromosome=7]','LINC00525 expression was significantly upregualted in NSCLC(non-small cell lung cancer) tissues and cell lines, and correlated with poor prognosis. LINC00525 depletion inhibited the proliferation, migration and invasion in NSCLC cell line A549 and SPC-A1 cells. In vivo study further confirmed that LINC00525 knockdown inhibited tumor growth in nude model. Mechanically, LINC00525 served as a molecular sponge for miR-338-3p, and modulated expression of endogenous miR-338-3p-targeted insulin receptor substrate 2(IRS2). ',147),('EL000148','CRNDE',' NONHSAT142613.2','643911','colorectal neoplasia differentially expressed;CRNDEP; PNAS-108; lincIRX5; LINC00180; NCRNA00180','human','REID0148','This gene is transcribed into multiple transcript variants, some of which may function as non-coding RNAs. One of the transcript variants encodes a putative short protein that is localized to the nucleus (PMID:25978564). Expression of this locus is increased in proliferating tissues, including certain tumors such as colorectal adenomas and adenocarcinomas. Transcription from this gene is negatively regulated by insulin and insulin-like growth factors, and may regulate the expression of genes involved in metabolism. ','>NC_000016.10:c54928886-54918863 CRNDE [organism=Homo sapiens] [GeneID=643911] [chromosome=16]','Long noncoding RNA CRNDE promotes non-small cell lung cancer progression via sponging microRNA-338-3p.knockdown of CRNDE significantly inhibited NSCLC(non-small cell lung cancer) cell proliferation, colony formation, migration and invasionin vitro, and decreased the xenograft tumor volume and weight in vitro.miR-338-3p is a downstream target of CRNDE and that miR-338-3p inhibition partially reversed the CRNDE depletion-mediated inhibitory effect on cell proliferation, colony formation, migration and invasion in NSCLC cells.',148),('EL000149','CASC15',' NONHSAT108049.2','401237','cancer susceptibility 15;CANT; LINC00340; lnc-SOX4-1','human','REID0149','This gene produces a long non-coding RNA that may regulate cell proliferation. This RNA is upregulated in hepatocellular carcinoma, where it is thought to function as an oncogene. However, some splice variants of this gene may function as a tumor suppressor in neuroblastoma and other tumor types. Circular RNA variants were observed at this gene.','>NC_000006.12:21666413-22195820 CASC15 [organism=Homo sapiens] [GeneID=401237] [chromosome=6]','CASC15 expression was remarkably upregulated in NSCLC samples compared with that in adjacent samples. Cell proliferation, invasion, and migration in NSCLC(non-small cell lung cancer) were inhibited via knockdown of CASC15 in vitro. Moreover, RT-qPCR results revealed that miR-130b-3p was upregulated via knockdown of CASC15 in vitro. In addition, miR-130b-3p was a direct target of CASC15 in NSCLC. Tumor formation and metastasis were inhibited after CASC15 was knockdown in vivo.',149),('EL000150','HOXA-AS2 ','NONHSAT211840.1','285943','HOXA cluster antisense RNA 2;HOXA3as','human','REID0150','This gene produces a long non-coding RNA that promotes cell proliferation. This transcript may interact with enhancer of zeste homolog 2 Polycomb repressive complex to repress gene expression.','>NC_000007.14:27121919-27128760 HOXA-AS2 [organism=Homo sapiens] [GeneID=285943] [chromosome=7]','LncRNA HOXA-AS2 promotes the progression of prostate cancer via targeting miR-509-3p/PBX3 axis.HOXA-AS2 depletion obviously influenced cell proliferation, migration, invasion, as well as epithelial-to-mesenchymal transition (EMT) progression. ',150),('EL000151','SNHG6 ',' NONHSAT127049.2','641638','small nucleolar RNA host gene 6;U87HG; HBII-276HG; NCRNA00058','human','REID0151','Not Found.','>NC_000008.11:c66925541-66921690 SNHG6 [organism=Homo sapiens] [GeneID=641638] [chromosome=8]','SNHG6 promoted EMT and BC cell proliferation and migration by acting as a miR-543 sponge and disinhibiting LAMC1/PI3K/AKT pathway. ',151),('EL000152','LncARSR ','Not Found.','102723932','lncRNA regulator of Akt signaling associated with HCC and RCC ;lnc-TALC','human','REID0152','Not Found.','>NC_000009.12:c79567770-79517873 LNCARSR [organism=Homo sapiens] [GeneID=102723932] [chromosome=9]','lncARSR sponges miR34a5p to promote colorectal cancer invasion and metastasis via hexokinase1mediated glycolysis.Functionally, ectopic expression of lncARSR promoted the invasion, metastasis, and glycolysis metabolic reprogramming of CRC cells in vitro and in vivo, while these activities were inhibited by silencing lncARSR expression.',152),('EL000153','LINC00472 ',' NONHSAT113508.2','79940','long intergenic non-protein coding RNA 472;P53RRA; C6orf155','human','REID0153','Not Found.','>NC_000006.12:c71420745-71407864 LINC00472 [organism=Homo sapiens] [GeneID=79940] [chromosome=6]','Forced expression of LINC00472 suppressed cell proliferation, migration, invasion and promoted cell apoptosis in HCC cells Huh-7 and SMMC-7721. MiR-93-5p was a direct target of LINC00472, and miR-93-5p directly targeted PDCD4. The miR-93-5p/PDCD4 pathway mediated the suppressing role of LINC00472 in HCC cells. ',153);
INSERT INTO `essential` VALUES ('EL000154','LINC01551',' NONHSAT168239.1','387978','long intergenic non-protein coding RNA 1551;C14orf23; c14_5148','human','REID0154','Not Found.','>NC_000014.9:28772704-28794794 LINC01551 [organism=Homo sapiens] [GeneID=387978] [chromosome=14]','Inhibition of LINC01551 Impeded NPC Cell Proliferation and Metastasis.',154),('EL000155','MCM3AP-AS1',' NONHSAT083039.2','114044','MCM3AP antisense RNA 1;C21orf85; MCM3APAS; MCM3AP-AS; MCM3APASB; NCRNA00031','human','REID0155','Not Found.','>NC_000021.9:46229231-46251701 MCM3AP-AS1 [organism=Homo sapiens] [GeneID=114044] [chromosome=21]','LncRNA MCM3AP-AS1 inhibits cell proliferation in cervical squamous cell carcinoma by down-regulating miRNA-93.',155),('EL000156','GAS1RR',' NONHSAT132841.2','100506834','GAS1 adjacent regulatory RNA;LncRNA-Hh','human','REID0156','Not Found.','>NC_000009.12:86948698-87002033 GAS1RR [organism=Homo sapiens] [GeneID=100506834] [chromosome=9]','The Shh-GLI1 pathway associated lncRNA-Hh, transcriptionally regulated by Twist, directly targets GAS1 to stimulate the activation of hedgehog signaling (Hh). The activated Hh increases GLI1 expression, and enhances the expression of SOX2 and OCT4 to play a regulatory role in CSC maintenance. Thus, the mammosphere-formation efficiency (MFE) and the self-renewal capacity in vitro, and oncogenicity in vivo in Twist-positive breast cancer cells are elevated. lncRNA-Hh silence in Twist-positive breast cells attenuates the activated Shh-GLI1 signaling and decreases the CSC-associated SOX and OCT4 levels, thus reduces the MFE and tumorigenesis of transplanted tumor.',156),('EL000157','NEAT1',' NONHSAT022112.2','283131','nuclear paraspeckle assembly transcript 1;VINC; TncRNA; LINC00084; NCRNA00084','human','REID0157','This gene produces a long non-coding RNA (lncRNA) transcribed from the multiple endocrine neoplasia locus. This lncRNA is retained in the nucleus where it forms the core structural component of the paraspeckle sub-organelles. It may act as a transcriptional regulator for numerous genes, including some genes involved in cancer progression. ','>NC_000011.10:65422798-65445540 NEAT1 [organism=Homo sapiens] [GeneID=283131] [chromosome=11]','NEAT1 negatively regulated cell proliferation and migration of neuroblastoma by the miR-183-5p/FOXP1 axis via suppression of the ERK/AKT pathway. ',157),('EL000158','SNHG1 ',' NONHSAT021826.2','23642','small nucleolar RNA host gene 1;UHG; U22HG; lncRNA16; LINC00057; NCRNA00057','human','REID0158','This locus represents a small nucleolar RNA host gene that produces multiple alternatively spliced long non-coding RNAs. This gene is upregulated in cancers and is thought to act as promoter of cell proliferation. This transcript negatively regulates tumor suppressor genes such as tumor protein p53. Expression of this locus may be a marker of tumor progression. ','>NC_000011.10:c62855885-62851978 SNHG1 [organism=Homo sapiens] [GeneID=23642] [chromosome=11]','High expression of lncRNA SNHG1 in prostate cancer patients and inhibition of SNHG1 suppresses cell proliferation and promotes apoptosis.',158),('EL000159','RHPN1-AS1','NONHSAT256395.1','78998','RHPN1 antisense RNA 1;C8orf51','human','REID0159','Not Found.','>NC_000008.11:c143368635-143366623 RHPN1-AS1 [organism=Homo sapiens] [GeneID=78998] [chromosome=8]','In vitro functional assays demonstrated that RHPN1-AS1 overexpression promoted SiHa cell proliferation, invasion and migration; while RHPN1-AS1 knockdown showed the opposite effects. ',159),('EL000160','EGFR-AS1','NONHSAT254175.1','100507500','EGFR antisense RNA 1','human','REID0160','Not Found.','>NC_000007.14:c55188949-55179750 EGFR-AS1 [organism=Homo sapiens] [GeneID=100507500] [chromosome=7]','EGFR-AS1 significantly up-regulated in GC tissues and correlated with tumor size. And the expression of EGFR-AS1 positively correlated with EGFR in tissues. Moreover, knock-down of EGFR-AS1 inhibited the proliferation of GC cells via suppressing EGFR-dependent PI3K/AKT pathway in vitro and in vivo. Mechanismly, depletion of EGFR-AS1 was found to decrease EGFR expression by reduction of EGFR mRNA stability.',160),('EL000161','TINCR','NONHSAT239707.1','257000','TINCR ubiquitin domain containing;PLAC2; LINC00036; NCRNA00036; onco-lncRNA-16','human','REID0161','This gene produces a spliced long non-coding RNA that binds RNAs. This transcript interacts with staufen-1 protein to regulate the stability of mRNAs for genes involved in the differentiation of epidermal tissue. Variation in this gene may be associated with cancer progression.','>NC_000019.10:c5568034-5558167 TINCR [organism=Homo sapiens] [GeneID=257000] [chromosome=19]','lncRNA PLAC2 down-regulated miR-21 in NSCLC and inhibited cancer cell migration and invasion.',161),('EL000162','GHET1 ','NONHSAT253766.1','102723099','gastric carcinoma proliferation enhancing transcript 1;lncRNA-GHET1','human','REID0162','This gene encodes an unspliced long non-coding RNA that has been suggested to promote the proliferation of gastric carcinoma cells and bladder cancer cells.','>NC_000007.14:148987527-148989429 GHET1 [organism=Homo sapiens] [GeneID=102723099] [chromosome=7]','GHET1 was up-regulated in osteosarcoma tissues and cell lines, inhibited cell apoptosis, promoted cell proliferation, invasion and migration by affecting EMT in vitro, and was correlated with the tumor growth and metastasis in vivo.',162),('EL000163','LINC00461',' NONHSAT102662.2','645323','long intergenic non-protein coding RNA 461;VISC; NDIME; ECONEXIN; EyeLinc1','human ','REID0163','This is an evolutionarily conserved gene that produces alternatively spliced long non-coding RNAs that may be expressed predominantly in the brain and visual cortex. These transcripts may be involved in tumorigenesis, as depletion by siRNA suppressed glioma cell division. Transcripts may also bind to and regulate the activity of miR-411-5p and argonaut 2, thereby altering the expression of genes involved in tumor growth.','>NC_000005.10:c88691041-88538266 LINC00461 [organism=Homo sapiens] [GeneID=645323] [chromosome=5]','Knockdown of LINC00461 inhibits cell proliferation and induces apoptosis in gastric cancer by targeting LSD1.LINC00461 is upregulated in GC(gastric cancer), which is positively related to TNM staging and lymphatic metastasis. LINC00461 mediates proliferation and apoptosis of GC cells, thereafter aggravating the progression of GC.',163),('EL000164','LINC00460',' NONHSAT232932.1','728192','long intergenic non-protein coding RNA 460','human ','REID0164','Not Found.','>NC_000013.11:106376564-106378595 LINC00460 [organism=Homo sapiens] [GeneID=728192] [chromosome=13]','Downregulated LINC00460 inhibits cell proliferation and promotes cell apoptosis in prostate cancer.downregulation of LINC00460 promoted apoptosis of cell lines and was related to PI3K/AKT pathway.',164),('EL000165','ACTA2-AS1','NONHSAT015482.2','100132116',' ACTA2 antisense RNA 1;ZXF1; UC001kfo; uc001kfo.1','human','REID0165','Not Found.','>NC_000010.11:88932684-88939974 ACTA2-AS1 [organism=Homo sapiens] [GeneID=100132116] [chromosome=10]','Knockdown of ACTA2?AS1 promotes liver cancer cell proliferation, migration and invasion.',165),('EL000166','MINCR','NONHSAT129558.2','100507316','MYC-induced long non-coding RNA ;LINC01604','human','REID0166','Not Found.','>NC_000008.11:c143281700-143280155 MINCR [organism=Homo sapiens] [GeneID=100507316] [chromosome=8]','Long noncoding RNA MINCR regulates cellular proliferation, migration, and invasion in hepatocellular carcinoma.',166),('EL000167','TRPM2-AS','NONHSAT244639.1','101928607','TRPM2 antisense RNA ;TRPM2-AS1','human','REID0167','Not Found.','>NC_000021.9:c44425563-44414590 TRPM2-AS [organism=Homo sapiens] [GeneID=101928607] [chromosome=21]','downregulation of TRPM2-AS inhibited the cell proliferation, migration, and invasion significantly (p < .05). TRPM2-AS inhibits the growth, migration, and invasion of gliomas through JNK, c-Jun, and RGS4.',167),('EL000168','LSINCT5','NONHSAT202121.1','101234261','long stress-induced non-coding transcript 5 ','human','REID0168','Not Found.','>NC_000005.10:2712591-2715237 LSINCT5 [organism=Homo sapiens] [GeneID=101234261] [chromosome=5]','Knockdown of lncRNA LSINCT5 suppresses growth and metastasis of human glioma cells via up-regulating miR-451.',168),('EL000169','LINC01234','NONHSAT030854.2','100506465',' long intergenic non-protein coding RNA 1234;LCAL84; onco-lncRNA-32','human','REID0169','Not Found.','>NC_000012.12:c113773683-113744577 LINC01234 [organism=Homo sapiens] [GeneID=100506465] [chromosome=12]','LINC01234 knockdown suppressed cell proliferation, migration, and invasion of colorectal cancer cells, while blocked cell cycle and induced cell apoptosis. ',169),('EL000170','LINC-ROR','NONHSAT059436.2','100885779',' long intergenic non-protein coding RNA, regulator of reprogramming;ROR; lincRNA-RoR; lincRNA-ST8SIA3','human','REID0170','This gene produces a long non-coding RNA that regulates the reprogramming of pluripotent stem cells. This RNA suppresses induction of tumor protein p53 after DNA damage. It is thought to act as a sponge for microRNAs that regulate stem cell factors POU class 5 homeobox 1, Nanog, and SRY-box 2. This RNA may also have a extracellular role in modulating response to hypoxia in hepatocellular cancer cells. Expression of this transcript is associated with tumor progression and epithelial to mesenchymal transition and metastasis.','>NC_000018.10:c57072119-57054559 LINC-ROR [organism=Homo sapiens] [GeneID=100885779] [chromosome=18]','LincRNA-ROR promotes invasion, metastasis and tumor growth in pancreatic cancer through activating ZEB1 pathway.',170),('EL000171','DDX11-AS1','NONHSAT231983.1','100506660','DDX11 antisense RNA 1;CONCR; SCAT4','human','REID0171','Not Found.','>NC_000012.12:c31073847-31020763 DDX11-AS1 [organism=Homo sapiens] [GeneID=100506660] [chromosome=12]','Long non-coding RNA DDX11-AS1 facilitates gastric cancer progression by regulating miR-873-5p/SPC18 axis.knockdown of DDX11-AS1 repressed cell proliferation and clone formation, while induced cell cycle arrest and apoptosis. As expected, DDX11-AS1 overexpression displayed the opposite effect. ',171),('EL000172','LINC00974','NONHSAT053635.2','147093','long intergenic non-protein coding RNA 974','human','REID0172','Not Found.','>NC_000017.11:c41554495-41549606 LINC00974 [organism=Homo sapiens] [GeneID=147093] [chromosome=17]','LncRNA LINC00974 Upregulates CDK6 to Promote Cell Cycle Progression in Gastric Carcinoma.',172),('EL000173','LINC00887',' NONHSAT094080.2','100131551',' long intergenic non-protein coding RNA 887;HEIRCC','human','REID0173','Not Found.','>NC_000003.12:c194312804-194301199 LINC00887 [organism=Homo sapiens] [GeneID=100131551] [chromosome=3]','Linc00887 suppresses tumorigenesis of cervical cancer through regulating the miR-454-3p/FRMD6-Hippo axis.',173),('EL000174','OTUD6B-AS1',' NONHSAT127668.2','100506365','OTUD6B antisense RNA 1 (head to head);GS1-251I9.4','human','REID0174','Not Found.','>NC_000008.11:c91070189-91059906 OTUD6B-AS1 [organism=Homo sapiens] [GeneID=100506365] [chromosome=8]','Novel long noncoding RNA OTUD6B-AS1 indicates poor prognosis and inhibits clear cell renal cell carcinoma proliferation via the Wnt/-catenin signaling pathway.',174),('EL000175','MBNL1-AS1',' NONHSAT196441.1','401093','MBNL1 antisense RNA 1 ','human','REID0175','Not Found.','>NC_000003.12:c152269626-152262616 MBNL1-AS1 [organism=Homo sapiens] [GeneID=401093] [chromosome=3]','LncRNA MBNL1-AS1 represses cell proliferation and enhances cell apoptosis via targeting miR-135a-5p/PHLPP2/FOXO1 axis in bladder cancer.',175),('EL000176','ASMTL-AS1',' NONHSAT136056.2','80161','ASMTL antisense RNA 1;ASMTLAS; CXYorf2; ASMTL-AS; NCRNA00105','human','REID0176','This gene serves as the antisense to the acetylserotonin O-methyltransferase-like gene. Multiple non-coding transcript variants have been found for this gene.','>NC_000023.11:1400531-1415421 ASMTL-AS1 [organism=Homo sapiens] [GeneID=80161] [chromosome=X,Y]>NC_000024.10:1400531-1415421 ASMTL-AS1 [organism=Homo sapiens] [GeneID=80161] [chromosome=X,Y]','Long non-coding RNA ASMTL-AS1 inhibits tumor growth and glycolysis by regulating the miR-93-3p/miR-660/FOXO1 axis in papillary thyroid carcinoma.',176);
